INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawy i płatności','','Warunki dostaw i płatności','conditions, delivery, delay, shipment, pack','<h2>Warunki dostaw i płatności</h2>\n<p></p>','dostawy-i-platnosci'),(2,1,1,'Polityka prywatności','','Polityka prywatności','notice, legal, credits','<p>Niniejsza polityka prywatności („Polityka Prywatności”) stanowi integralną część Regulaminu Sklepu internetowego Duży Biceps. Akceptacja Regulaminu oznacza również akceptację Polityki Prywatności. Przed rozpoczęciem korzystania z Sklepu Internetowego Kupujący powinien zapoznać się z Polityką Prywatności. Polityka Prywatności określa zasady przetwarzania i ochrony danych osobowych osób korzystających ze strony https://ostrovit.com</p>\n<div>\n<p dir=\"ltr\">1. Administrator</p>\n<p>1.1. Administratorem danych osobowych - w skrócie ADO, osób korzystających ze Sklepu internetowego Duży Biceps , w tym Kupujących i Użytkowników, jest Janusz Kowalski.</p>\n<p>1.2. Administrator przetwarza dane osobowe zgodnie z wymogami Rozporządzenia Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (dalej jako „RODO”).</p>\n<p dir=\"ltr\">2. Gromadzone Dane</p>\n<p dir=\"ltr\">Gromadzone dane osobowe obejmują: imię i nazwisko, nazwa (firma), NIP, adres prowadzenia działalności, adres dostawy, numer telefonu, e-mail, dane karty kredytowej, numer rachunku bankowego, login i hasło Użytkownika, adres IP komputera z którego dokonano rejestracji lub złożono zamówienie. Dane osobowe gromadzone są przy rejestracji Użytkownika, wypełnianiu formularza Zamówienia, formularza zapisu na newsletter, w trakcie komunikacji z podmiotem danych. Sklep zachowuję również historię zakupów Kupującego.</p>\n<p dir=\"ltr\">3. Cele przetwarzania Danych</p>\n<p dir=\"ltr\">Dane przetwarzane będą w celu:</p>\n<p dir=\"ltr\">3.1. Świadczenia usługi Konta – przez okres prowadzenia Konta na rzecz Kupującego, aż do momentu likwidacji Konta Kupującego na żądanie Kupującego - na podstawie art. 6 ust. 1 lit. b) RODO;</p>\n<p dir=\"ltr\">3.2. Zawarcia i realizacji Umów sprzedaży produktów za pośrednictwem Sklepu Internetowego – do czasu zakończenia realizacji umowy - na podstawie art. 6 ust. 1 lit. b) oraz art. 9 ust. 2 lit. h) RODO;</p>\n<p dir=\"ltr\">3.3. Realizacji przez Administratora ciążących na nim obowiązków prawnych, w szczególności wynikających z przepisów prawa podatkowego – przez okres 5 lat, licząc od końca roku kalendarzowego, w którym upłynął termin płatności podatku należnego w związku z zawarciem i realizacją umowy sprzedaży produktu za pośrednictwem Sklepu Internetowego, albo dłużej jeżeli wymagają tego przepisy prawa - na podstawie art. 6 ust. 1 lit. c) oraz art. 9 ust. 2 lit. h) RODO;</p>\n<p dir=\"ltr\">3.4. ustalenia, dochodzenia lub obrony przed roszczeniami jakie Administrator albo Kupujący może mieć w stosunku do siebie (w tym danych zawartych w Koncie Użytkownika, danych dotyczących umów sprzedaży produktów za pośrednictwem Sklepu internetowego – na podstawie art. 6 ust. 1 lit. f) oraz art. 9 ust. 2 lit. h) RODO - przez okresy przedawnienia roszczeń, określone w przepisach prawa;</p>\n<p dir=\"ltr\">3.6. Wysyłania newslettera z treściami informacyjnymi dotyczącymi ochrony zdrowia, produktów oferowanych przez Administratora – aż do cofnięcia zgody - na podstawie art. 6 ust. 1 lit. a) RODO;</p>\n<p dir=\"ltr\">3.7. Wyświetlania reklam spersonalizowanych na stronie Sklepu internetowego, w tym zrozumienia procesów zakupowych i powiązań między produktami, na podstawie historii zakupów, produktów znajdujących się w koszyku klienta oraz historii przeglądanych produktów – aż do wniesienia sprzeciwu - na podstawie art. 6 ust. 1 lit. f) RODO;</p>\n<p dir=\"ltr\">4. Dobrowolność podania danych, zgoda na przetwarzanie</p>\n<p dir=\"ltr\">4.1. Podanie danych jest dobrowolne. W zakresie wskazanym w Regulaminie podanie danych jest konieczne w celu Rejestracji lub złożenia i realizacji Zamówienia.</p>\n<p dir=\"ltr\">4.2 Kupujący może podać swoje dane osobowe, nie wyrażając jednocześnie zgody na ich przetwarzanie w celu otrzymywania newslettera.</p>\n<p dir=\"ltr\">4.3 W przypadku udzielenia zgody na przetwarzanie danych Kupującego w powyższych celach, Kupujący może cofnąć tę zgodę w dowolnym momencie, kontaktując się Biurem Obsługi Klienta pod adresem sales@ostrovit.com tel.: (+48) 669094455. Zgodę na otrzymywanie newsletter mogą Państwo cofnąć również klikając w odpowiedni link, umieszczony w każdym newsletterze. Cofnięcie zgody pozostaje bez wpływu na zgodność z prawem przetwarzania, którego dokonano na podstawie zgody przed jej cofnięciem.</p>\n<p dir=\"ltr\">5. Prawa związane z przetwarzaniem danych osobowych</p>\n<p dir=\"ltr\">5.1. Każdemu, czyje dane osobowe są przetwarzane przysługuje prawo dostępu do dotyczących go danych osobowych, ich sprostowania, usunięcia lub prawo sprzeciwu wobec przetwarzania (o ile jest to możliwe w świetle przepisów prawa), ograniczenia przetwarzania, a także prawo do przenoszenia danych. Osobie której dane są przetwarzane przysługuje także prawo wniesienia skargi do organu ochrony danych osobowych.</p>\n<p dir=\"ltr\">5.2 Kontakt z Administratorach Danych Osobowych lub osobą przez niego upoważnioną możliwy jest pod adresem: daneosobowe@fitnesstrading.eu</p>\n<p dir=\"ltr\">5.3. Przewidywanymi odbiorcami danych osobowych są podmioty którym Administrator powierza przetwarzanie danych, w celu realizacji Umowy sprzedaży, oraz obsługi działalności firmy / Sprzedawcy:</p>\n<p dir=\"ltr\">- dostarczające infrastrukturę techniczną wykorzystywaną w celu prowadzenia Sklepu internetowego (IAI S.A. z siedzibą w Szczecinie, Aleja Piastów 30, 71-064 Szczecin, jako operator oprogramowania IdoSell Shop);</p>\n<p dir=\"ltr\">- serwisujące oprogramowanie Optima ERP - obsługa magazynowo-księgowa firmy Sprzedawcy (DAMCOM GRUPA Sp. zo.o. z siedzibą w Warszawie, ul. Nowogrodzka 31 00-511 Warszawa - jako partner firmy Comarch).</p>\n<p dir=\"ltr\">- dostawcy usług logistycznych - realizacja sprzedaży wysyłkowej (INPOST PACZKOMATY Sp.z o.o. z siedzibą w Krakowie, ul. Wielicka 28, 30-552 Kraków) oraz (DPD Polska sp. z o.o. z siedzibą w Warszawie, ul. Mineralnej 15, 02-274 Warszawa).</p>\n<p dir=\"ltr\">- podmiot któremu Administrator zlecił prowadzenie obsługi księgowo-doradczej (Kancelaria Podatkowa Saldo S.A. z siedzibą w Ostrowi Mazowieckiej, Dubois 1/25, 07-300 Ostrów Mazowiecka).</p>\n<p dir=\"ltr\">- podmiot któremu Administrator zlecił obsługę wysyłania wiadomości e-mail (GetResponse Sp. z o.o.  z siedzibą w Gdańsku, ul. Arkońska 6, A3 80-387 Gdańsk)</p>\n<p dir=\"ltr\">- upoważnieni pracownicy i współpracownicy ADO  – w zakresie w jakim jest to niezbędne do realizacji celów określonych w niniejszej Polityce Prywatności lub wynikających z umów, jakie zawarł Kupujący z ADO.</p>\n<p dir=\"ltr\">5.4. W celu zaoferowania Ci metody płatności Klarna możemy w procesie dokonywania zakupu przekazać Twoje dane osobowe w postaci danych kontaktowych oraz szczegółów zamówienia do Klarna w celu dokonania przez Klarna oceny, czy kwalifikujesz się do metody płatności Klarna i w celu dostosowania tych metod do Ciebie. Twoje przekazane dane osobowe są przetwarzane zgodnie z <a href=\"https://cdn.klarna.com/1.0/shared/content/legal/terms/0/pl_pl/privacy\">polityką prywatności Klarna</a>.</p>\n<p dir=\"ltr\">5.5. ADO może odmówić usunięcia Danych, jeżeli istnieją przesłanki wynikające z przepisów prawa.</p>\n<p dir=\"ltr\">6. Zabezpieczenie Danych</p>\n<p dir=\"ltr\">6.1. ADO stosuje odpowiednie środki techniczne i organizacyjne zapewniające ochronę przetwarzanych danych, a w szczególności zabezpiecza dane przed ich udostępnieniem osobom nieupoważnionym, przetwarzaniem z naruszeniem prawa oraz zmianą, utratą, uszkodzeniem lub zniszczeniem.</p>\n<p dir=\"ltr\">6.2. Do przetwarzania danych Kupującego wewnątrz organizacji firma Administratora dopuszczane są wyłącznie osoby upoważnione przez ADO.</p>\n<p dir=\"ltr\">7. Pozostałe postanowienia</p>\n<p dir=\"ltr\">7.1. Dane mogą być udostępniane podmiotom uprawnionym do ich otrzymania na mocy obowiązujących przepisów prawa, w tym właściwym organom wymiaru sprawiedliwości. Administrator przekazuje zebrane dane osobowe organom administracji państwowej, organom ścigania oraz organom wymiaru sprawiedliwości na ich wyraźne żądanie i tylko w przypadkach określonych przez przepisy prawa.</p>\n<p dir=\"ltr\">7.2. Sprzedawca jest uczestnikiem programu „Zaufane Opinie” w ramach usługi świadczonej przez Ceneo Sp. z o.o. z siedzibą w Poznaniu (60-166), ul. Grunwaldzka 182, wpisaną do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy Poznań – Nowe Miasto i Wilda w Poznaniu, VIII Wydział Gospodarczy KRS, pod numerem KRS: 0000493884, NIP: 7792420393, oraz uczestnikiem programu „Wiarygodne Opinie” w ramach usługi świadczonej przez Opineo Sp. z o.o. z siedzibą we Wrocławiu (53-333), ul. Powstańców Śląskich 2-4, wpisaną do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy dla Wrocławia-Fabrycznej we Wrocławiu, VI Wydział Gospodarczy KRS, pod numerem KRS: 0000357466, NIP: 8971762604, polegających na przesyłaniu za pośrednictwem poczty elektronicznej odpowiednio przez Ceneo Sp. z o.o. i Opineo Sp. z o.o. - po uzyskaniu zgody Kupującego - ankiet służących uzyskaniu od Kupującego opinii na temat dokonanej transakcji oraz zakupionego produktu a także na zamieszczaniu w serwisie dostępnym w domenie Ceneo.pl i Opineo.pl opinii wyrażonych przez Kupujących w rezultacie otrzymania ankiet.</p>\n<p dir=\"ltr\">7.3. Kupujący dokonujący zakupu w Sklepie internetowym może dobrowolnie wyrazić zgodę na przekazanie jego danych osobowych, w tym adresu e-mail, do Ceneo Sp. z o.o. i Opineo Sp. z o.o. oraz na przetwarzanie przez Ceneo Sp. z o.o. i Opineo Sp. z o.o. jego danych osobowych – wyłącznie w celu wypełnienia ankiety wskazanej w ust. 7.2.</p>\n<p dir=\"ltr\">7.4. Informacje dotyczące wykorzystania plików cookies zawarte są w Polityce Cookies.</p>\n<p dir=\"ltr\">7.5. Administrator danych osobowych zastrzega sobie prawo do wprowadzania zmian w Polityce Prywatności. Każdą osobę wykorzystującą w jakikolwiek sposób Sklep Internetowy obowiązuje aktualna wersja Polityki Prywatności.</p>\n</div>','polityka-prywatnosci'),(3,1,1,'Regulamin','','Regulamin naszego sklepu','conditions, terms, use, sell','<h4>REGULAMIN SKLEPU INTERNETOWEGO</h4>\n<h4 style=\"text-align:center;\">§ 1 DEFINICJE</h4>\n<ol>\n<li>\n<p dir=\"ltr\">REGULAMIN - niniejszy Regulamin świadczenia usług i sprzedaży wysyłkowej określający zasady korzystania ze Sklepu Internetowego, świadczonych za jego pośrednictwem usług drogą elektroniczną związanych z dokonywaniem zamówień oferowanych przez Sprzedawcę.</p>\n</li>\n<li>\n<p dir=\"ltr\">SPRZEDAWCA - jest firma Duzy Biceps</p>\n</li>\n<li>\n<p dir=\"ltr\">SKLEP INTERNETOWY - portal internetowy Sprzedawcy, prowadzony pod adresem, za pośrednictwem którego Sprzedawca świadczy usługi elektroniczne związane ze sprzedażą wysyłkową.</p>\n</li>\n<li>\n<p dir=\"ltr\">UMOWA SPRZEDAŻY - oznacza umowę sprzedaży zawartą na odległość, na zasadach określonych w Regulaminie, między Kupującym a Sprzedawcą.</p>\n</li>\n<li>\n<p dir=\"ltr\">TOWAR - oznacza produkt przedstawiony przez Sprzedawcę za pośrednictwem strony internetowej Sklepu internetowego, mogący być przedmiotem Umowy sprzedaży.</p>\n</li>\n<li>\n<p dir=\"ltr\">KUPUJĄCY - osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w przypadkach przewidzianych przez przepisy prawa powszechnie obowiązującego również osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych, a także osoba prawna lub jednostka organizacyjna nie posiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną, dokonująca zakupów w Sklepie internetowym.</p>\n</li>\n<li>\n<p dir=\"ltr\">KONTO - podstrona Sklepu internetowego chroniona indywidualnym hasłem, na której gromadzone są informacje o Kupującym i dokonywanych przez niego zamówieniach.</p>\n</li>\n<li>\n<p dir=\"ltr\">UŻYTKOWNIK - Kupujący, który dokonał rejestracji indywidualnego Konta w Sklepie internetowym.</p>\n</li>\n<li>\n<p dir=\"ltr\">ZAMÓWIENIE - oświadczenie woli Kupującego określające jednoznacznie rodzaj i ilość towarów, zmierzające bezpośrednio do zawarcia Umowy Sprzedaży.</p>\n</li>\n<li>\n<p dir=\"ltr\">RODO - Rozporządzenie Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych).</p>\n</li>\n</ol>\n<h4 dir=\"ltr\" style=\"text-align:center;\">§ 2 ZASADY OGÓLNE</h4>\n<ol>\n<li>\n<p dir=\"ltr\">Niniejszy Regulamin określa zasady korzystania ze Sklepu internetowego dostępnego pod adresem</p>\n</li>\n<li>\n<p dir=\"ltr\">Warunkiem złożenia Zamówienia w Sklepie Internetowym przez Kupującego jest zapoznanie się z niniejszym Regulaminem i akceptacja jego postanowień w czasie realizacji Zamówienia.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sklep internetowy <a href=\"https://ostrovit.com/\">http://www.OstroVit.com</a> prowadzi sprzedaż detaliczną za pośrednictwem sieci Internet.</p>\n</li>\n</ol>\n<ol start=\"4\">\n<li>\n<p dir=\"ltr\">Wszystkie towary oferowane w Sklepie internetowym są fabrycznie nowe, oryginalnie zapakowane, wolne od wad fizycznych i prawnych, zostały nabyte od uprawnionych podmiotów zgodnie z obowiązującym prawem i są przechowywane w warunkach określonych odpowiednimi przepisami. Produkty w uszkodzonym opakowaniu, które są z tego tytułu przecenione, opatrzone są odpowiednią adnotacją w tym zakresie.</p>\n</li>\n<li>\n<p dir=\"ltr\">Niniejszy Regulamin, wszelkie prawa i obowiązki z niego wynikające, a także powstałe w trakcie realizacji Zamówienia, podlegają prawu polskiemu.</p>\n</li>\n<li>\n<p dir=\"ltr\">W ramach wymagań technicznych niezbędnych do współpracy z systemem teleinformatycznym, którym posługuje się Sprzedawca w celu realizacji zakupów, Kupujący powinien dysponować aktywnym kontem poczty elektronicznej (e-mail) oraz urządzeniem podłączonym do sieci Internet.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący zobowiązany jest do niedostarczania treści zabronionych przez przepisy prawa, np. treści propagujące przemoc, zniesławiające lub naruszających dobra osobiste i inne prawa osób trzecich.</p>\n</li>\n<li>\n<p dir=\"ltr\">Regulamin może ulec zmianie. W przypadku zmiany Regulaminu Sprzedający umieści na stronie głównej Sklepu internetowego informację o zmianie Regulaminu wraz z zestawieniem wprowadzonych zmian. Użytkownicy posiadający Konto zostaną dodatkowo powiadomieni o zmianie Regulaminu poprzez przesłanie informacji zawierającej zestawienie zmian Regulaminu na adres e-mail przypisany do Konta.</p>\n</li>\n</ol>\n<h4 dir=\"ltr\" style=\"text-align:center;\">§ 3 SKŁADANIE ZAMÓWIENIA</h4>\n<ol>\n<li>\n<p dir=\"ltr\">Wszystkie ceny podane w Sklepie internetowym Duży Biceps cenami brutto. Podane ceny nie obejmują kosztów wysyłki.</p>\n</li>\n<li>\n<p dir=\"ltr\">Zamówienia są przyjmowane przez stronę Sklepu internetowego / telefonicznie / drogą mailową.</p>\n</li>\n<li>\n<p dir=\"ltr\">Zamówienia składane poprzez stronę Sklepu internetowego można składać 24 godziny na dobę, 7 dni w tygodniu przez cały rok.</p>\n</li>\n<li>\n<p dir=\"ltr\">Zamówienie jest skuteczne, jeśli Kupujący prawidłowo wypełni formularz zamówienia i (lub) prawidłowo poda dane kontaktowe w tym dokładny adres, na który towar ma być wysłany oraz numer telefonu i adres e-mail.</p>\n</li>\n<li>\n<p dir=\"ltr\">W przypadku gdy podane dane nie są kompletne, Sprzedawca skontaktuję się z Kupującym. Jeśli kontakt z Kupującym nie będzie możliwy, Sprzedawca ma prawo do anulowania Zamówienia. Co jest jednoznaczne z odstąpieniem od Umowy sprzedaży.</p>\n</li>\n<li>\n<p dir=\"ltr\">Warunkiem zawarcia Umowy Sprzedaży jest akceptacja przez Kupującego Regulaminu oraz Polityki prywatności, która jest integralną częścią regulaminu.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący w procesie składania Zamówienia może wyrazić wolę otrzymania paragonu fiskalnego lub Faktury VAT, która może zostać załączona do wysyłanej przesyłki lub przesłana drogą elektroniczną, na wskazany adres e-mail w postaci elektronicznego obrazu dokumentów rozliczeniowych, w szczególności takich jak: faktury VAT z załącznikami, faktury VAT korygujące z załącznikami i formularzy. Niniejsza zgoda uprawnia Sprzedawcę również do wystawiania i przesyłania faktur VAT w formie elektronicznej, zgodnie z rozporządzeniem Ministra Finansów z dnia 20 grudnia 2012r. w sprawie przesyłania  faktur w formie elektronicznej, zasada ich przechowywania oraz trybu udostępniania organowi podatkowemu lub organowi kontroli skarbowej.</p>\n</li>\n<li>\n<p dir=\"ltr\">W trakcie składania Zamówienia, Kupujący musi wyrazić zgodę na umieszczenie danych osobowych w bazie danych osobowych Sklepu Internetowego Sprzedawcy w celu ich przetwarzania – w związku z realizacją Zamówienia. W wypadku udzielenia zgody, Kupujący ma prawo do wglądu w swoje dane, ich poprawiania oraz żądania ich usunięcia.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący może skorzystać z opcji zapamiętania jego danych przez system w celu ułatwienia procesu składania kolejnego Zamówienia. W tym celu Kupujący powinien podać login i hasło, niezbędne do uzyskania dostępu do swojego konta. Login Kupującego to podany przez niego adres e-mail. Hasło jest ciągiem znaków ustalanych przez Kupującego. Hasło Kupującego nie jest znane Sprzedawcy. Kupującego ma obowiązek zachowania go w tajemnicy i chronienia przed niepowołanym dostępem do osób trzecich.</p>\n</li>\n<li>\n<p dir=\"ltr\">Po złożeniu przez Kupującego skutecznego zamówienia, otrzyma on automatyczną odpowiedź ze sklepu potwierdzającą otrzymanie zamówienia.</p>\n</li>\n<li>\n<p dir=\"ltr\">Czas rozpoczęcia realizacji zależny jest od sposobu płatności za Zamówienie. W przypadku płatności przelewem na wskazane przez Sprzedawcę konto bankowe rozpoczęcie realizacji Zamówienia następuję po zaksięgowaniu pełnej kwoty na koncie bankowym Sprzedawcy.<br />W przypadku płatności “za pobraniem (płatność przy odbiorze)”, oraz w przypadku ekspresowych płatności elektronicznych (w tym płatnośc kartą), rozpoczęcie realizacji Zamówienia następuję w przeciągu maksymalnie trzech dni roboczych.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca odmawia realizacji Zamówienia w następujących przypadkach:</p>\n</li>\n</ol>\n<ul>\n<li>\n<p dir=\"ltr\">Kupujący podał dane niekompletne, uniemożliwiając realizację Zamówienia.</p>\n</li>\n<li>\n<p dir=\"ltr\">towar został wycofany z obrotu lub wstrzymany w obrocie na terenie Rzeczpospolitej Polskiej po złożeniu zamówienia.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca nie ma możliwości zrealizować Zamówienia Kupującego (incydentalna niezgodność stanów magazynowych bądź incydentalne uszkodzenie towaru).</p>\n</li>\n</ul>\n<ol start=\"13\">\n<li>\n<p dir=\"ltr\">W przypadkach wymienionych w ust. 11 Sprzedawca zobowiązuje się niezwłocznie (w przeciągu 5 dni roboczych) licząc od dnia złożenia zamówienia, powiadomić o tym Kupującego drogą elektroniczną lub telefoniczną. W przypadku gdy Kupujący uiścił już zapłatę za Zamówienie, Sprzedawca zobowiązuje się zwrócić pełną kwotę w przeciągu 5 dni roboczych licząc od dnia złożenia zamówienia.</p>\n</li>\n</ol>\n<h4 dir=\"ltr\" style=\"text-align:center;\">§ 4 KOSZTY I TERMIN WYSYŁKI</h4>\n<ol>\n<li>\n<p dir=\"ltr\">towar wysyłany jest pod adres wskazany w formularzu Zamówienia lub podany telefonicznie albo drogą mailową. Sklep poinformuje Kupującego niezwłocznie o nieprawidłowo wypełnionym formularzu Zamówienia, który uniemożliwia dokonanie wysyłki lub może ją opóźnić.</p>\n</li>\n<li>\n<p dir=\"ltr\">towar jest dostarczany za pomocą wyspecjalizowanych firm kurierskich lub za pośrednictwem Poczty Polskiej. Istnieje możliwość odbioru osobistego Zamówienia w wskazanych w formularzu zakupu lokalizacjach.</p>\n</li>\n<li>\n<p dir=\"ltr\">Przesyłka dostarczona jest zgodnie z terminem podanym przy każdym towarze na stronie serwisu. Jest to orientacyjny czas dostawy i dotyczy on zamówień z opcją przesyłki „za pobraniem”. Przy wyborze opcji płatności „przelew” lub „płatność kartą lub przelewem online” do czasu podanego na stronach serwisu należy doliczyć czas zaksięgowania środków na rachunku bankowym sklepu. (zwykle 1-2 dni robocze). Sprzedawca zastrzega sobie maksymalny czas realizacji zamówienia do pięciu dni roboczych.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący jest obciążany kosztami dostawy (wysyłki) określonymi w cenniku transportu. Klient może się zapoznać z cennikiem w każdej chwili klikając w link (Wysyłka i płatności).</p>\n</li>\n<li>\n<p dir=\"ltr\">W przypadku, gdy Zamówienie nie może zostać poprawnie i terminowo doręczone z winy Kupującego (błędny adres, odmowa przyjęcia), Sprzedawca zastrzega sobie prawo obciążenia Kupującego kosztami ponownego transportu zgodnie z aktualnym cennikiem dostaw. Przed odbiorem przesyłki od firmy kurierskiej Kupujący zobowiązany jest sprawdzić, czy opakowanie nie uległo uszkodzeniu podczas transportu. W szczególności należy zwrócić uwagę na stan opakowania, taśm naklejonych na przesyłkę. W przypadku, gdy przesyłka nosi znamiona uszkodzenia należy odmówić przyjęcia przesyłki, a następnie skontaktować się z Sprzedawcą za pośrednictwem poczty elektronicznej bądź telefonicznie w celu poinformowania o uszkodzonej przesyłce.</p>\n</li>\n</ol>\n<h4 style=\"text-align:center;\">§ 5 PŁATNOŚCI</h4>\n<ol>\n<li>\n<p dir=\"ltr\">Na każdy sprzedany towar wystawiamy paragon fiskalny lub Faktura VAT (po wcześniejszym zaznaczeniu takiej opcji w formularzu Zamówienia.)</p>\n</li>\n<li>\n<p dir=\"ltr\">Płatność za zamówiony towar może nastąpić za pobraniem (przy odbiorze towaru), za pośrednictwem systemów płatności elektronicznych lub przelewem na konto bankowe sklepu. W przypadku odbioru osobistego istnieje możliwość płatności przy odbiorze Zamówienia.</p>\n</li>\n</ol>\n<h4 dir=\"ltr\" style=\"text-align:center;\">§ 6 REKLAMACJE</h4>\n<ol>\n<li>\n<p dir=\"ltr\">Sprzedawca zobowiązany jest do sprzedaży Kupującemu towarów nie wadliwych, z wyjątkiem przecenionych towarów niepełnowartościowych, które Kupujący zamówił wiedząc o wadzie. W razie niezgodności towaru z umową bądź w zakresie nieprawidłowości w świadczeniu usług drogą elektroniczną Kupujący powinien zgłosić Sprzedawcy reklamację za pośrednictwem poczty elektronicznej (sales@ostrovit.com) lub posiadając Konto w Sklepie Internetowym w zakładce “TWOJE KONTO” a następnie wypełnić formularz reklamacyjny pojawiający się po kliknięciu w przycisk “Dodaj reklamację”.</p>\n</li>\n<li>\n<p dir=\"ltr\">Do czasu zamknięcia postępowania reklamacyjnego należy bezwzględnie zachować wszelkie reklamowane towary w stanie nienaruszonym.</p>\n</li>\n<li>\n<p dir=\"ltr\">Jeżeli towar ma wadę, Kupujący może złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od umowy, chyba że Sprzedawca niezwłocznie i bez nadmiernych niedogodności dla Kupującego wymieni towar wadliwy na wolny od wad albo wadę usunie. Ograniczenie to nie ma zastosowania, jeżeli towar był już wymieniony lub naprawiany przez Sprzedawcę albo Sprzedawca nie uczyniła zadość obowiązkowi wymiany towaru na wolny od wad lub usunięcia wady.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący może zamiast zaproponowanego przez Sprzedawcę usunięcia wady żądać wymiany towaru na wolny od wad albo zamiast wymiany towaru żądać usunięcia wady, chyba że doprowadzenie towaru do zgodności z umową w sposób wybrany przez Kupującego jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez Sprzedawcę.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący nie może odstąpić od umowy w ramach procedury opisanej w niniejszym §6, jeżeli wada jest nieistotna.</p>\n</li>\n<li>\n<p dir=\"ltr\">Jeśli towar sprzedany ma wadę, kupujący może również żądać wymiany towaru na wolny od wad albo usunięcia wady. Sprzedawca jest wówczas obowiązana wymienić towar wadliwy na wolny od wad lub usunąć wadę w rozsądnym czasie bez nadmiernych niedogodności dla Kupującego. Sprzedawca może odmówić zadośćuczynienia żądaniu Kupującego, jeżeli doprowadzenie do zgodności z umową towaru wadliwego w sposób wybrany przez Kupującego jest niemożliwe albo w porównaniu z drugim możliwym sposobem doprowadzenia do zgodności z umową wymagałoby nadmiernych kosztów.</p>\n</li>\n<li>\n<p dir=\"ltr\">Reklamowane towary należy dostarczyć do Sprzedawcy wraz z wypełnionym „Zgłoszeniem reklamacji”. Sugerujemy opatrzenie przesyłki z reklamowanymi towarami informacją: „REKLAMACJA TOWARU”. Reklamowane towary należy przesłać lub dostarczyć osobiście na adres: Fitness Trading Robert Szulborski Sp. z o.o. ul. Sitarska 16 18-300 Zambrów. Sprzedawca nie przyjmuje przesyłek za pobraniem.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca ustosunkuje się do zgłoszonego przez Kupującego żądania (reklamacji) w ciągu 14 dni od dnia otrzymania zgłoszenia żądania. W braku ustosunkowania się przez Sprzedawcę we wskazanym terminie uważa się, że żądanie uznano za uzasadnione.</p>\n</li>\n<li>\n<p dir=\"ltr\">Reklamowane towary, odsyłane przez Kupującego w celu naprawy (usunięcia wady), Sprzedawca niezwłocznie po ich otrzymaniu odsyła do właściwego punktu serwisowego.</p>\n</li>\n<li>\n<p dir=\"ltr\">W przypadku odrzucenia reklamacji przez Sprzedawcę Kupujący może skorzystać z pomocy miejskiego lub powiatowego rzecznika konsumentów, wojewódzkich inspektoratów Inspekcji Handlowej lub jednej z organizacji społecznych, do której zadań statutowych należy ochrona konsumentów np. Federacji Konsumentów. Szczegółowe informacje o pozasądowych sposobach rozpatrywania reklamacji i dochodzenia roszczeń dostępne są w siedzibach lub na stronach internetowych rzeczników konsumentów, wojewódzkich inspektoratów Inspekcji Handlowej, właściwych organizacji społecznych oraz pod adresami dostępnymi na stronie Urzędu Ochrony Konkurencji i Konsumentów: <a href=\"http://www.uokik.gov.pl/wazne_adresy.php\" rel=\"nofollow\">www.uokik.gov.pl/wazne_adresy.php</a>.</p>\n</li>\n<li>\n<p dir=\"ltr\">W przypadku odrzucenia reklamacji przez Sprzedawcę, Kupujący może skorzystać z postępowania pozasądowego w celu rozstrzygnięcia sporu. Podmiotem właściwym do prowadzenia takiego postępowania jest Wojewódzki Inspektor Inspekcji Handlowej w Białymstoku, którego strona internetowa dostępna jest pod adresem: http://www.bialystok.wiih.gov.pl</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący mogą również skorzystać z unijnej platformy internetowego rozstrzygania sporów. Platforma internetowego rozstrzygania sporów pomiędzy Klientami a przedsiębiorcami na szczeblu unijnym dostępna jest pod adresem <a href=\"http://ec.europa.eu/consumers/odr/\" rel=\"nofollow\">http://ec.europa.eu/consumers/odr/</a>.</p>\n</li>\n</ol>\n<h4 style=\"text-align:center;\">§ 7 ODSTĄPIENIE OD UMOWY I ZWROT TOWARÓW</h4>\n<ol>\n<li>\n<p dir=\"ltr\">Kupujący może w terminie 14 (czternastu) dni od dnia odebrania zamówienia odstąpić od umowy bez podawania przyczyny i bez ponoszenia kosztów, określonych poniżej.</p>\n</li>\n<li>\n<p dir=\"ltr\">Jeżeli Kupujący wybrał sposób dostarczenia towaru inny niż najtańszy zwykły sposób dostarczenia oferowany przez Sprzedawcę, Sprzedawca nie jest zobowiązana do zwrotu Kupującemu poniesionych przez niego dodatkowych kosztów.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący ponosi tylko bezpośrednie koszty zwrotu towarów.</p>\n</li>\n<li>\n<p dir=\"ltr\">W przypadku terminowego odstąpienia od umowy oraz terminowego dostarczenia zwracanego zamówienia do Sprzedawcy, Sprzedawca zwróci Kupującemu całość otrzymanej od Kupującego płatności.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący może zrezygnować z części lub całości zamówionych towarów wysyłając w terminie 14 (czternastu) dni od dnia odebrania przesyłki zawierającej towary „Oświadczenie o odstąpieniu od umowy”, na adres poczty elektronicznej sales@ostrovit.com lub pisemnie na adres Fitness Trading Robert Szulborski Sp. z o.o. ul. Sitarska 16 18-300 Zambrów.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący posiadający Konto w Sklepie internetowym mogą dokonać zwrotu wypełniając formularz znajdujący się w zakładce TWOJE KONTO / ZWROTY TOWARÓW / DODAJ ZWROT</p>\n</li>\n<li><strong>Prawo odstąpienia od umowy nie przysługuje Klientowi w przypadkach w której przedmiotem świadczenia (Towarem) jest rzecz dostarczana w zapieczętowanym opakowaniu, której po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu Towaru, w szczególności dotyczy to suplementów diety oraz produktów spożywczych.</strong></li>\n<li>\n<p dir=\"ltr\">Zwrot towarów powinien nastąpić w terminie 14 (czternastu) dni od dnia, w którym Kupujący odstąpił od umowy. Do zachowania terminu wystarczy odesłanie towarów przed jego upływem.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sugerujemy odesłanie zwracanych towarów w miarę możliwości w oryginalnym opakowaniu, z oryginalnymi banderolami, bez jakichkolwiek znamion ingerencji w ich konstrukcję lub korzystania z nich. Kupujący ponosi odpowiedzialność za zmniejszenie wartości towaru będące wynikiem korzystania z niego w sposób wykraczający poza konieczny do stwierdzenia jego charakteru, cech i funkcjonowania.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sugerujemy opatrzenie przesyłki ze zwracanymi towarami informacją „ZWROT TOWARU”. Przesyłki ze zwracanymi towarami należy przesłać lub dostarczyć osobiście na adres: Fitness Trading Robert Szulborski Sp. z o.o. ul. Sitarska 16 18-300 Zambrów.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca zwraca Kupującemu uiszczoną przez niego płatność korzystając z tego samego sposobu zapłaty, jakiego użył Kupujący. Zwrot płatności dokonywany jest przez Sprzedawcę niezwłocznie, nie później jednak niż w terminie 14 (czternastu) dni od dnia otrzymania oświadczenia konsumenta o odstąpieniu od umowy. Sprzedawca może wstrzymać się ze zwrotem płatności do chwili otrzymania przesyłki zawierającej zwracane towary lub dowodu jej odesłania.</p>\n</li>\n<li>\n<p dir=\"ltr\">Prosimy o odpowiednie zabezpieczenie zwracanych towarów i ich nieodsyłanie w kopertach lub kopertach bąbelkowych. Sprzedawca nie przyjmuje przesyłek za pobraniem.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący może w ramach rękojmi żądać wymiany towaru, naprawy towaru, obniżenia ceny lub odstępstwa od umowy. Reklamacja zostanie rozpatrzona w terminie 14 dni kalendarzowych, liczonych od dnia jej złożenia.</p>\n</li>\n<li>\n<p dir=\"ltr\">Prawo odstąpienia od umowy nie przysługuje Kupującemu w odniesieniu do umów, w których:</p>\n</li>\n</ol>\n<ul>\n<li>\n<p dir=\"ltr\">przedmiotem umowy są towary mające krótki termin przydatności do użycia, o czym Sprzedawca informowała klienta przy składaniu zamówienia;</p>\n</li>\n<li>\n<p dir=\"ltr\">przedmiotem umowy są towary, które po dostarczeniu w zapieczętowanym opakowaniu zostały otwarte, oraz których po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych;</p>\n</li>\n<li>\n<p dir=\"ltr\">przedmiotem umowy są produkty lecznicze, środki spożywcze specjalnego przeznaczenia żywieniowego i wyroby medyczne, zgodnie z §6 ust. 1 powyżej.</p>\n</li>\n</ul>\n<h4 dir=\"ltr\" style=\"text-align:center;\">§ 8 OCHRONA DANYCH</h4>\n<ol>\n<li>\n<p dir=\"ltr\">Sprzedawca gwarantuje ścisłą ochronę danych osobowych przekazywanych przez Kupującego i przetwarzanie ich wyłącznie w celu realizacji zamówienia lub w celach, na które Kupujący wyraził zgodę, z zachowaniem wymogu bezpieczeństwa danych osobowych określonego w przepisach ustawy z dnia 29 sierpnia 1997 r. o ochronie danych osobowych (j.t. Dz. U. z 2016 r., poz. 922<span id=\"docs-internal-guid-450a1ced-93ea-da7a-8647-62710debb750\"> z późn. zm.).</span></p>\n</li>\n<li>\n<p dir=\"ltr\">Administratorem danych osobowych Sklepu Internetowego działającego pod adresem <a href=\"https://ostrovit.com\">http://www.OstroVit.com</a> jest firma Fitness Trading Robert Szulborski Sp. z o.o.  ul. Sitarska 16 18-300 Zambrów. Dane osobowe archiwizowane są w biurze firmy mieszczącej się pod adresem: Fitness Trading Robert Szulborski Sp. z o.o. ul. Sitarska 16 18-300 Zambrów.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca przetwarza dane osobowe w celu realizacji zamówienia na podstawie art. 6 ust. 1 lit. b RODO. Kupujący przekazuje Sprzedawcy dane osobowe dobrowolnie, jednak mając świadomość, iż są one niezbędne do zawarcia Umowy sprzedaży.</p>\n</li>\n<li>\n<p dir=\"ltr\"><span id=\"docs-internal-guid-c27c674e-93eb-4833-20ca-8d6038805dec\">Dane osobowe przechowywane są w sposób bezpieczny dla Kupującego przez czas nieokreślony, w celu prowadzenia polityki rabatowej Sklepu Internetowego oraz w celach skarbowych w okresie ustawowym.</span></p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący ma prawo do sprostowania, usunięcia lub ograniczenia przetwarzania, a także prawo do wniesienia sprzeciwu wobec przetwarzania oraz prawo do przenoszenia swoich danych osobowych.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący ma prawo do wniesienia skargi do organu nadzorczego, którym jest <span id=\"docs-internal-guid-cdf5716f-93eb-7ae2-8244-46bd5dbf8f2e\">Generalny Inspektor Danych Osobowych.</span></p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca zobowiązuje się do przestrzegania tajemnicy związanej z danymi Kupującego i nieudostępnianie tych danych osobom nieuprawnionym. Zobowiązuje się również do należytego zabezpieczenia tych informacji przed dostępem wszelkich osób nieuprawnionych.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca nie może wykorzystywać danych osobowych Kupującego w celach innych niż wskazane w Regulaminie.</p>\n</li>\n<li>\n<p dir=\"ltr\">Sprzedawca jest uczestnikiem programu „Zaufane Opinie” w ramach usługi świadczonej przez Ceneo Sp. z o.o. z siedzibą w Poznaniu (60-166), ul. Grunwaldzka 182, wpisaną do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy Poznań – Nowe Miasto i Wilda w Poznaniu, VIII Wydział Gospodarczy KRS, pod numerem KRS: 0000493884, NIP: 7792420393, oraz uczestnikiem programu „Wiarygodne Opinie” w ramach usługi świadczonej przez Opineo Sp. z o.o. z siedzibą we Wrocławiu (53-333), ul. Powstańców Śląskich 2-4, wpisaną do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy dla Wrocławia-Fabrycznej we Wrocławiu, VI Wydział Gospodarczy KRS, pod numerem KRS: 0000357466, NIP: 8971762604, polegających na przesyłaniu odpowiednio przez Ceneo Sp. z o.o. i Opineo Sp. z o.o. - po uzyskaniu zgody Kupującego, o której mowa w ust. 3 poniżej - do Kupujących za pośrednictwem poczty elektronicznej ankiet służących uzyskaniu od Kupującego opinii na temat dokonanej w Sklepie internetowym transakcji oraz zakupionego produktu a także na zamieszczaniu w serwisie dostępnym w domenie Ceneo.pl i Opineo.pl opinii wyrażonych przez Kupujących w rezultacie otrzymania ankiet.</p>\n</li>\n<li>\n<p dir=\"ltr\">Kupujący dokonujący zakupu w Sklepie internetowym może dobrowolnie wyrazić zgodę na przekazanie jego danych osobowych, w tym adresu e-mail do Ceneo Sp. z o.o. i Opineo Sp. z o.o. oraz na przetwarzanie przez Ceneo Sp. z o.o. i Opineo Sp. z o.o. jego danych osobowych – wyłącznie w celu wypełnienia ankiety wskazanej w ust. 9.</p>\n</li>\n<li>\n<p dir=\"ltr\">W celu zapewnienia bezpieczeństwa Kupujących Sprzedawca podejmuje środki techniczne i organizacyjne odpowiednie do stopnia zagrożenia bezpieczeństwa świadczonych usług.</p>\n</li>\n<li>\n<p dir=\"ltr\">W sprawach nieuregulowanych niniejszym regulaminem zastosowanie mają postanowienia Kodeksu cywilnego i odpowiednich ustaw prawa polskiego, a także prawa Unii Europejskiej, w szczególności RODO.</p>\n</li>\n</ol>','regulamin'),(4,1,1,'O nas','','Dowiedz się więcej o Dużym Bicepsie','about us, informations','<h2>O Nas</h2>\n<h3>Duży Biceps Sp. z o. o.</h3>\n<p>ul. Gabriela Narutowicza 11/12<br />80-233 Gdańsk<br />Polska <br />Zadzwoń do nas: <span>123 456 789</span> <br />Napisz do nas: <a href=\"mailto:duzybiceps@outlook.com\">duzybiceps@outlook.com</a></p>','o-nas'),(5,1,1,'Reklamacje i zwroty','','Nasza polityka reklamacji i zwrotów','','<h2>Nasza polityka reklamacji i zwrotów</h2>\n<p></p>','reklamacje-i-zwroty');
