INSERT INTO `ps_product_lang` VALUES (916,1,1,'','','test','','','','test','','','',''),(917,1,1,NULL,'<p>OstroVit Magnesium Potassium + B6 Shot 80 ml to suplement diety w płynie. Zawiera substancje słodzące. Napój niegazowany zawierający magnez (375 mg/80 ml), z dodatkiem potasu oraz witaminy B6. To suplement przeznaczony dla osób dorosłych, aktywnych fizycznie, zwłaszcza sportowców, które mają zwiększone zapotrzebowanie na magnez, potas i witaminę B6. Zalecany w okresach wzmożonego wysiłku.</p>','ostrovit-magnesium-potassium---b6-shot-80-ml-cytrynowo-limonkowo-winogronowy',NULL,NULL,NULL,'OstroVit Magnesium Potassium + B6 Shot 80 ml cytrynowo-limonkowo-winogronowy',NULL,NULL,NULL,NULL),(918,1,1,NULL,'<p>OstroVit Witamina D3 + K2 to kompozycja witamin pochodząca z naturalnych surowców. Witamina K2 MK-7 jest formą witaminy K2 przyswajalną w najwyższym stopniu przez nasz organizm. Otrzymywana jest z tradycyjnego japońskiego sfermentowanego produktu soi, w wyniku fermentacji bakterii Bacillus subtilis natto.</p>','ostrovit-witamina-d3---k2-90-tabletek-',NULL,NULL,NULL,'OstroVit Witamina D3 + K2 90 tabletek ',NULL,NULL,NULL,NULL),(919,1,1,NULL,'<p>OstroVit Shot to profesjonalny produkt przed treningowy oparty o cztery synergicznie uzupełniające się substancje czynne, które wspólnie sprawią, że Twój trening stanie się jeszcze lepszy, jeszcze intensywniejszy, zakrawający na prawdziwą transcendencję.</p>','ostrovit-shot-80-ml-limonkowy',NULL,NULL,NULL,'OstroVit Shot 80 ml limonkowy',NULL,NULL,NULL,NULL),(920,1,1,NULL,'<p>OstroVit Berberyna to suplement diety w tabletkach zawierający ekstrakt z berberyny.Berberyna ma pozytywny wpływ na pracę jelit, oraz regulację wyściółki jelitowej co przekłada się na lepsze funkcjonowanie układu pokarmowego. Berberyna może być stosowana w przypadkach rozregulowania gospodarki cukrowej i insulinowej organizmu z tego względu, że wpływa na wzrost ilości, jak również czułości receptorów insulinowych. Co więcej, opóźnia rozkład węglowodanów złożonych do cukrów prostych, także przez regulację makrobiotyki, stymulując preferencyjne zużycie SFA. Berberyna naśladuje działanie insuliny, zwiększając zużycie glukozy, dzięki czemu nazywana jest insulinomimetykiem.</p>','ostrovit-berberyna-90-tabletek-',NULL,NULL,NULL,'OstroVit Berberyna 90 tabletek ',NULL,NULL,NULL,NULL),(921,1,1,NULL,'<p>OstroVit CLA 1000 to najwyższej jakości suplement diety zawierający sprzężony kwas linolowy CLA. Kwas CLA posiada bardzo pozytywny wpływ na organizm człowieka. Wykazuje działanie wspomagające przyrost beztłuszczowej masy mięśniowej oraz pomaga spalić zbędną tkankę tłuszczową.</p>','ostrovit-cla-1000-mg-30-kapsulek-',NULL,NULL,NULL,'OstroVit CLA 1000 mg 30 kapsułek ',NULL,NULL,NULL,NULL),(922,1,1,NULL,'<p>OstroVit Supreme Capsules Tribulus Terrestris to najwyższej jakości suplement diety zawierający ekstrakt z całej rośliny buzdyganka naziemnego (Tribulus terrestris L.) o łącznej zawartości 90% saponin. Składniki zawarte mogą wspomagać wzrost endogennego testosteronu w organizmie oraz zapewni witalność i energię nie tylko sportowcom, ale każdemu, kto dba o swoje samopoczucie.</p>','ostrovit-tribulus-terrestris-900-mg-60-kapsulek-',NULL,NULL,NULL,'OstroVit Tribulus Terrestris 900 mg 60 kapsułek ',NULL,NULL,NULL,NULL),(923,1,1,NULL,'<p>OstroVit Fat Burner eXtreme to preparat o niecodziennej kombinacji naturalnych substancji, które wspomagają oraz przyśpieszają proces lipolizy, czyli rozkładu i spalania tkanki tłuszczowej, oraz ułatwiających utrzymanie prawidłowej masy ciała. OstroVit Fat Burner to ekstremalne pobudzenie na każdej sesji treningowej i istny kop energetyczny. </p>','ostrovit-fat-burner-extreme-90-kapsulek-',NULL,NULL,NULL,'OstroVit Fat Burner eXtreme 90 kapsułek ',NULL,NULL,NULL,NULL),(924,1,1,NULL,'<p>OstroVit 100% Vit&Min to kompozycja wysokoprzyswajalnych witamin i minerałów. Formuła preparatu posiada w składzie kompleks zaspokajający zapotrzebowanie dorosłego człowieka. Produkt szczególnie polecany jest osobom żyjącym aktywnie, szczególnie uprawiającym sport. Vit&Min to preparat złożony zawierający witaminy i minerały zawierają wysoką zawartość biologiczną, co sprawia, że są one doskonale przyswajalne przez organizm i zapewniają wysoki poziom energii przez cały dzień. Suplement żywności firmy OstroVit to idealne rozwiązanie w okresie intensywnego wysiłku fizycznego i psychicznego. Zawarty w preparacie kompleks witamin i minerałów pozwoli również na szybki powrót do sprawności fizycznej w okresie rekonwalescencji po przebytych chorobach i kontuzjach.</p>','ostrovit-100-vit-min-90-tabletek-',NULL,NULL,NULL,'OstroVit 100% Vit&Min 90 tabletek ',NULL,NULL,NULL,NULL),(925,1,1,NULL,'<p>OstroVit Olej MCT to nic innego jak najwyższej jakości średniołańcuchowe kwasy tłuszczowe MCT (medium-chain triglycerides), zamknięte tym razem w plastikową, nietłuczącą się butelkę PET wolną od BPA (bisfenolu A). Średniołańcuchowe kwasy tłuszczowe zalecane są szczególnie sportowcom i osobom o zwiększonej aktywności fizycznej.</p>','ostrovit-olej-mct-500-ml-naturalny',NULL,NULL,NULL,'OstroVit Olej MCT 500 ml naturalny',NULL,NULL,NULL,NULL),(926,1,1,NULL,'<p>OstroVit Fat Burner Extreme Shot to wygodny w stosowaniu suplement diety w formie płynnej stworzony z myślą o osobach, które aktywnie walczą z nadmiarowymi kilogramami. Połączenie 11 składników aktywnych wspomaga spalanie tkanki tłuszczowej w organizmie, ale także dodaje energii przed ćwiczeniami, reguluje poziom hormonów, wspiera regenerację tkanek i mięśni po wysiłku fizycznym oraz zapewnia zdrowy wygląd. Jeżeli jesteś na redukcji, przed treningiem wypij nasz shot, by zyskać jeszcze więcej energii i motywacji do działania!</p>','ostrovit-fat-burner-extreme-shot-80-ml-wisniowo-pomaranczowy',NULL,NULL,NULL,'OstroVit Fat Burner eXtreme Shot 80 ml wiśniowo-pomarańczowy',NULL,NULL,NULL,NULL),(927,1,1,NULL,'<p>OstroVit PUMP PRE-WORKOUT SHOT to rewolucyjna przedtreningówka w postaci jabłkowego niewielkiego napoju, który dostarczy Ci energii i siły podczas aktywności fizycznej. Nasz owocowy shot stanowi połączenie aż 4 różnych składników aktywnych. Sprawią one, że Twój trening będzie jeszcze bardziej efektywny. Poszukujesz suplementu diety, którego składniki wspomogą wydolność i wytrzymałość Twojego organizmu, a także podniosą efektywność treningu? Postaw na OstroVit PUMP PRE-WORKOUT SHOT – niewielki napój o wielkiej mocy!</p>','ostrovit-pump-pre-workout-shot-bez-beta-alaniny-100-ml-wisniowy',NULL,NULL,NULL,'OstroVit Pump Pre-Workout Shot bez beta-alaniny 100 ml wiśniowy',NULL,NULL,NULL,NULL),(928,1,1,NULL,'<p>OstroVit Berberyna HCl 97% to wegański suplement diety w kapsułkach zawierający ekstrakt z korzenia berberysu standaryzowany na 97% chlorowodorku berberyny. Składniki suplementu pomogą zadbać o zdrowie układu pokarmowego oraz sercowo-naczyniowego. </p>','ostrovit-berberyna-hcl-97-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Berberyna HCl 97% VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(929,1,1,NULL,'<p>OstroVit Chalk Block to nic innego jak magnezja w kostce. Produkt, dzięki któremu polepszysz swój uchwyt. Wystarczy potrzbną ilość rozkruszyć na mniejsze porcje i  potrzeć nią dłonie, aby znacząco polepszyć uścisk podczas ciężkich sesji treningowych na drążkach, poręczach czy siłowni. Taka forma sprasowanej magnezji, nie rozpyla się, co jest jej dużą zaletą.</p>','ostrovit-magnezja-w-kostce-57-g-',NULL,NULL,NULL,'OstroVit Magnezja w kostce 57 g ',NULL,NULL,NULL,NULL),(930,1,1,NULL,'<p>OstroVit CLA 1000 to najwyższej jakości suplement diety zawierający sprzężony kwas linolowy CLA. Posiada bardzo pozytywny wpływ na organizm człowieka. Wykazuje działanie wspomagające przyrost beztłuszczowej masy mięśniowej oraz pomaga spalić zbędną tkankę tłuszczową.</p>','ostrovit-cla-1000-mg-180-kapsulek-',NULL,NULL,NULL,'OstroVit CLA 1000 mg 180 kapsułek ',NULL,NULL,NULL,NULL),(931,1,1,NULL,'<p>OstroVit FAT BURNER for WOMEN to suplement diety, który został opracowany z myślą o płci \"pięknej\". Wyjątkowy skład naturalnych komponentów wspierających redukcję nadmiaru tkanki tłuszczowej. Standaryzowane ekstrakty oraz najlepiej przyswajalne formy produktu w tym: ekstrakt z nasion afrykańskiego mango, ekstrakt z ziaren zielonej kawy, ekstrakt z korzenia imbiru czy skuteczna forma L-Karnityny.</p>','ostrovit-fat-burner-for-women-60-kapsulek-',NULL,NULL,NULL,'OstroVit Fat Burner for women 60 kapsułek ',NULL,NULL,NULL,NULL),(932,1,1,NULL,'<p>OstroVit CLA 1000 to najwyższej jakości suplement diety zawierający sprzężony kwas linolowy CLA. Kwas CLA posiada bardzo pozytywny wpływ na organizm człowieka. Wykazuje działanie wspomagające przyrost beztłuszczowej masy mięśniowej oraz pomaga spalić zbędną tkankę tłuszczową.</p>','ostrovit-cla-1000-mg-90-kapsulek-',NULL,NULL,NULL,'OstroVit CLA 1000 mg 90 kapsułek ',NULL,NULL,NULL,NULL),(933,1,1,NULL,'<p>OstroVit Cytrulina Shot to suplement diety stworzony z myślą o osobach prowadzących aktywny tryb życia. Jabłczan L-cytruliny wspiera prawidłową budowę mięśni, a jego regularne przyjmowanie może przyczynić się do poprawy wyników sportowych. Składniki suplementu pomogą uchronić Twoje mięśnie przed zmęczeniem oraz szybciej zregenerować się po intensywnym treningu.</p>','ostrovit-cytrulina-shot-100-ml-zurawinowy',NULL,NULL,NULL,'OstroVit Cytrulina Shot 100 ml żurawinowy',NULL,NULL,NULL,NULL),(934,1,1,NULL,'<p>OstroVit Water Jug 1890 ml to butelka na wodę wykonana z wysokiej jakości tworzywa, którą możesz zabrać ze sobą na siłownię lub inne miejsce, w którym masz zamiar uprawiać aktywność fizyczną.</p>','ostrovit-water-jug-1890-ml-',NULL,NULL,NULL,'OstroVit Water Jug 1890 ml ',NULL,NULL,NULL,NULL),(935,1,1,NULL,'<p>OstroVit Sleep Well Shot to zestaw aż sześciu składników aktywnych w postaci shota o smaku jagodowym. Nasz kolejny innowacyjny z serii shotów OstroVit preparat zawiera  między innymi melatoninę, witaminę B6, kwas GABA, aminokwasy oraz ekstrakt z szyszek chmielu. Poszukujesz suplementu diety,  którego składniki wspomagają zasypianie i poprawiają jakość snu? Postaw na OstroVit Sleep Well Shot 100 ml - niewielki napój o wielkiej mocy!</p>','ostrovit-sleep-well-shot-100-ml-jagodowy',NULL,NULL,NULL,'OstroVit Sleep Well Shot 100 ml jagodowy',NULL,NULL,NULL,NULL),(936,1,1,NULL,'<p>OstroVit Vitamin C to najwyższej klasy preparat dla osób aktywnych fizycznie, składający się wyłącznie z kwasu L-askorbinowego, czyli witaminy C. Suplement nie zawiera zbędnych zbrylaczy, wypełniaczy i innych dodatków, a jego mikronizacja stoi na najwyższym farmaceutycznym poziomie. Idealna biodostępność produktu, została podyktowana wysokimi wymaganiami konsumentów.</p>','ostrovit-witamina-c-500-g-naturalny',NULL,NULL,NULL,'OstroVit Witamina C 500 g naturalny',NULL,NULL,NULL,NULL),(937,1,1,NULL,'<p>OstroVit Vitamin C 30 tabletek to naturalne wsparcie układu odpornościowego. Vitamin C marki OstroVit dostarcza 1000 mg kwasu askorbinowego do organizmu w każdej porcji. Witamina C wzmacnia barierę ochronną oraz wspomaga ją w walce z drobnoustrojami i wirusami, a dodatkowo poprawia stan tkanki łącznej i wspiera kondycję psychofizyczną.</p>','ostrovit-witamina-c-30-tabletek-',NULL,NULL,NULL,'OstroVit Witamina C 30 tabletek ',NULL,NULL,NULL,NULL),(938,1,1,NULL,'<p>OstroVit MSM Plus to preparat będący źródłem metylosulfonylometanu, czyli organicznego związku siarki, glukozaminy, a także witaminy C, które synergicznie wspólnie tworzą znakomity kompleks wspomagający działanie chrząstek, kości, naczyń krwionośnych, dziąseł, skóry oraz zębów.</p>','ostrovit-msm-plus-300-g-naturalny',NULL,NULL,NULL,'OstroVit MSM Plus 300 g naturalny',NULL,NULL,NULL,NULL),(939,1,1,NULL,'<p>OstroVit Creatine Monohydrate to najwyższej jakości monohydrat kreatyny, który wielokrotnie potęguje anaboliczne, ergogeniczne i antykataboliczne działanie kreatyny.</p>','ostrovit-monohydrat-kreatyny-500-g-arbuzowy',NULL,NULL,NULL,'OstroVit Monohydrat Kreatyny 500 g arbuzowy',NULL,NULL,NULL,NULL),(940,1,1,NULL,'<p>OstroVit Braintus Focus to suplement diety, którego składniki aktywne wspierają prawidłową pracę umysłu. W formule OstroVit Braintus Focus znajduje się aż 9 starannie dobranych składników aktywnych, które pomogą Ci pobudzić pamięć, uzyskać optymalną koncentrację i zyskać energię do działania. Poznaj je bliżej i otwórz się na nowe możliwości.</p>','ostrovit-braintus-focus-90-kapsulek-',NULL,NULL,NULL,'OstroVit Braintus Focus 90 kapsułek ',NULL,NULL,NULL,NULL),(941,1,1,NULL,'<p>OstroVit Olej MCT z kokosa to wartościowe źródło nasyconych kwasów tłuszczowych, które wspierają ogólne zdrowie i kondycję organizmu. Codzienne spożywanie oleju MCT z kokosa pozwoli Ci dostarczyć do organizmu takie związki jak kwas kaprylowy oraz kwas kaprynowy.</p>','ostrovit-olej-mct-z-kokosa-500-ml-naturalny',NULL,NULL,NULL,'OstroVit Olej MCT z kokosa 500 ml naturalny',NULL,NULL,NULL,NULL),(942,1,1,NULL,'<p>OstroVit L-Teanina to wegański suplement diety który zawiera w swoim składzie L-teaninę oraz inulinę. Substancje polecane są  osobom które żyją w ciągłym napięciu, mają problemy z nauką i koncentracją.</p>','ostrovit-l-teanina-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit L-Teanina VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(943,1,1,NULL,'<p>OstroVit Potassium Citrate to suplement diety w proszku zawierający potas w formie cytrynianu potasu o smaku cytryny z limonką. Regularne spożywanie potasu przyczynia się do prawidłowego funkcjonowania wielu układów wewnętrznych, a także wspiera równowagę wodno-elektrolitową organizmu. Jeśli zatem poszukujesz suplementu diety  wyróżniającego się wysoką biodostępnością w formie organicznego cytrynianu potasu, wypróbuj nasz suplement diety OstroVit Potassium Citrate.</p>','ostrovit-cytrynian-potasu-200-g--cytrynowo-limonkowy',NULL,NULL,NULL,'OstroVit Cytrynian Potasu 200 g  cytrynowo-limonkowy',NULL,NULL,NULL,NULL),(944,1,1,NULL,'<p>OstroVit NAC to suplement diety w formie proszku, który zawiera wyłącznie czystą N-acetylo-L-cysteinę, będącą pochodną L-cysteiny, czyli aminokwasu siarkowego. Związek ten znany jest ze swoich silnych właściwości antyoksydacyjnych. NAC jest bardzo wartościowym źródłem L-cysteiny, która potrzebna jest do syntezy glutationu pełniącego w organizmie funkcję bardzo silnego antyoksydantu odpowiedzialnego za wsparcie działania wątroby.</p>','ostrovit-nac-200-g-naturalny',NULL,NULL,NULL,'OstroVit NAC 200 g naturalny',NULL,NULL,NULL,NULL),(945,1,1,NULL,'<p>OstroVit D.A.A 1000 to wysokiej jakości, nowoczesny preparat w kapsułkach składający się wyłącznie z jednej substancji, jaką jest kwas D-asparaginowy. Produkt został rozdrobniony poprzez poddanie go procesowi mikronizacji, co pozwala na jeszcze lepszą wchłanialność. Supreme Capsules -minimalizm składu oraz maksymalne porcje z myślą o najlepszych. </p>','ostrovit-daa-1000-mg-120-kapsulek-',NULL,NULL,NULL,'OstroVit D.A.A 1000 mg 120 kapsułek ',NULL,NULL,NULL,NULL),(946,1,1,NULL,'<p>OstroVit Testotabs to suplement diety stworzony z myślą o wszystkich aktywnych mężczyznach, którzy chcą w naturalny sposób podnieść poziom testosteronu w organizmie. Środek zawiera zestaw ekstraktów roślinnych, minerałów oraz witamin, które wzmacniają organizm, wspierają odporność, a także mogą poprawić ogólną sprawność seksualną.</p>','ostrovit-testotabs-90-tabletek-',NULL,NULL,NULL,'OstroVit Testotabs 90 tabletek ',NULL,NULL,NULL,NULL),(947,1,1,NULL,'<p>OstroVit Pharma Witamina B12 Metylokobalamina to nowoczesny suplement diety w sprayu, którego składniki pomogą zadbać o zdrowie układu odpornościowego oraz krwionośnego.</p>','ostrovit-pharma-witamina-b12-metylokobalamina-w-sprayu-30-ml-',NULL,NULL,NULL,'OstroVit Pharma Witamina B12 Metylokobalamina w sprayu 30 ml ',NULL,NULL,NULL,NULL),(948,1,1,NULL,'<p>OstroVit Pharma D3 4000 + K2 MK-7 to suplement diety w postaci tabletek zawierający w swoim składzie kompozycję witaminy D oraz K, pochodzące z naturalnych surowców.</p>','ostrovit-pharma-d3-4000---k2-mk-7-90-tabletek-',NULL,NULL,NULL,'OstroVit Pharma D3 4000 + K2 MK-7 90 tabletek ',NULL,NULL,NULL,NULL),(949,1,1,NULL,'<p>OstroVit Arginina to suplement zawierający składnik, jakim jest l-arginina. W trosce o jakość i zadowolenie konsumentów preparat został poddany najwyższemu poziomowi mikronizacji, co świadczy o jego doskonałości. Arginina jest uznawana za jeden z lepszych noboosterów. Dzięki swoim właściwościom arginina będąca substratem syntezy tlenku azotu obniża ciśnienie krwi i polepsza transport tlenu do naszych komórek mięśniowych.</p>','ostrovit-arginina-210-g-cytrynowy',NULL,NULL,NULL,'OstroVit Arginina 210 g cytrynowy',NULL,NULL,NULL,NULL),(950,1,1,NULL,'<p>OstroVit Beef Amino 300 to suplement diety w tabletkach, dostarczający aminokwasy pochodzenia wołowego. Produkt został opracowany z najwyższej jakości zhydrolizowanego białka, który przyczynia się do wzrostu lub utrzymania masy mięśniowej. Przeznaczony dla osób szczególnie narażonych na katabolizm mięśniowy oraz dla trenujących siłowo, wytrzymałościowo lub siłowo-wytrzymałościowo.</p>','ostrovit-beef-amino-300-tabletek-',NULL,NULL,NULL,'OstroVit Beef Amino 300 tabletek ',NULL,NULL,NULL,NULL),(951,1,1,NULL,'<p>OstroVit Witamina D3 4000 + K2 MK-7 Shot to zestaw dwóch składników aktywnych w postaci shota o smaku soczystego kiwi. Nasz kolejny z serii shot zawiera witaminę D3 i K2 MK-7.  Poszukujesz suplementu diety,  którego składniki optymalnie uzupełnią dzienne zapotrzebowanie na witaminę D3 i K2? Postaw na OstroVit Witamina D3 4000 + K2 MK-7 Shot 100 ml - niewielki napój o wielkiej mocy!</p>','ostrovit-witamina-d3-4000---k2-mk-7-shot-100-ml-kiwi',NULL,NULL,NULL,'OstroVit Witamina D3 4000 + K2 MK-7 Shot 100 ml kiwi',NULL,NULL,NULL,NULL),(952,1,1,NULL,'<p>OstroVit Witamina E Naturalny Kompleks Tokoferoli to wszechstronny suplement diety, którego składniki wspomogą Twój organizm w ochronie przed szkodliwym działaniem wolnych rodników pochodzących z żywności oraz środowiska. Witamina E oraz kompleks czterech naturalnych tokoferoli charakteryzują się działaniem przeciwutleniającym.</p>','ostrovit-witamina-e-naturalny-kompleks-tokoferoli-90-kapsulek-',