,'<p>OstroVit Zinc 60.000 to suplement diety w formie tabletek stworzony z myślą o osobach, które chcą w łatwy sposób uzupełnić niedobory cynku w organizmie. Dzięki zastosowaniu wysoko przyswajalnego pikolinianu cynku suplement charakteryzuje się szybkim i skutecznym działaniem.</p>','ostrovit-cynk-60000-90-tabletek-',NULL,NULL,NULL,'OstroVit Cynk 60.000 90 tabletek ',NULL,NULL,NULL,NULL),(975,1,1,NULL,'<p>OstroVit Aqua Kick Vitamin C to suplement diety, dzięki któremu w łatwy i szybki sposób dostarczysz do organizmu niezbędną dzienną dawkę witaminy C. Ten znany ze swoich silnych właściwości antyoksydacyjnych składnik pełni w organizmie wiele bardzo ważnych funkcji, a jego niedobory mogą okazać się bardzo dotkliwe.</p>','ostrovit-aqua-kick-vitamin-c-10-g-',NULL,NULL,NULL,'OstroVit Aqua Kick Vitamin C 10 g ',NULL,NULL,NULL,NULL),(976,1,1,NULL,'<p>OstroVit Glucosamine 1000 mg to najwyżej jakości suplement diety, będący źródłem glukozaminy. Preparat przeznaczony dla osób aktywnych fizycznie, narażonych na nadmierne obciążenie stawów oraz osób z nadwagą. Glukozamina jest substancją, którą przyczynia się do odbudowy chrząstki stawowej. Pozwala utrzymać stawy, chrząstki oraz ścięgna w dobrej kondycji.</p>','ostrovit-glukozamina-1000-mg-60-kapsulek-',NULL,NULL,NULL,'OstroVit Glukozamina 1000 mg 60 kapsułek ',NULL,NULL,NULL,NULL),(977,1,1,NULL,'<p>OstroVit Arginina 1000 mg to suplement diety w kapsułkach zawierający tylko jeden składnik, jakim jest l-arginina. W trosce o jakość i zadowolenie konsumentów preparat został poddany najwyższemu poziomowi mikronizacji, co świadczy o jego doskonałości. Arginina jest uznawana za jeden z lepszych noboosterów. Dzięki swoim właściwościom arginina będąca substratem syntezy tlenku azotu obniża ciśnienie krwi i polepsza transport tlenu do naszych komórek mięśniowych.</p>','ostrovit-arginina-1000-mg-150-kapsulek-',NULL,NULL,NULL,'OstroVit Arginina 1000 mg 150 kapsułek ',NULL,NULL,NULL,NULL),(978,1,1,NULL,'<p>OstroVit EAA 1150 mg - to kompl