każdym calu!</p>','ostrovit-leucyna-200-г-naturalny',NULL,NULL,NULL,'OstroVit Leucyna 200 г naturalny',NULL,NULL,NULL,NULL),(982,1,1,NULL,'<p>OstroVit Pea Protein Vege to najwyższej jakości białko z izolatu białka grochu, które zawiera aż 85% białka. Jest przeznaczone dla osób, które ze względu na swoją dietę oraz zapotrzebowanie chciałyby ją uzupełnić w dodatkową ilość białka. Białko przyczynia się do wzrostu masy mięśniowej oraz pomaga w jej utrzymaniu. Przyczynia się także w utrzymaniu zdrowych kości.</p>','ostrovit-bialko-grochu-vege-700-g-naturalny',NULL,NULL,NULL,'OstroVit Białko Grochu VEGE 700 g naturalny',NULL,NULL,NULL,NULL),(983,1,1,NULL,'<p>OstroVit BCAA 8-1-1 (True Taste) to najwyższej klasy preparat dla osób aktywnych fizycznie, składający się wyłącznie z trzech aminokwasów rozgałęzionych, jakimi są: leucyna, walina oraz izoleucyna. Mikronizacja produktu stoi na najwyższym poziomie. Idealna biodostępność i wysoka rozpuszczalność produktu, zostały podyktowane wysokimi wymaganiami konsumentów.</p>','ostrovit-bcaa-8-1-1-400-g-cytrynowy',NULL,NULL,NULL,'OstroVit BCAA 8-1-1 400 g cytrynowy',NULL,NULL,NULL,NULL),(984,1,1,NULL,'<p>OstroVit Beta-Alanine 800 mg to znakomity suplement znajdujący zastosowanie podczas ciężkich sesji treningowych. OstroVit Beta-Alanina 800 mg to preparat stworzony z myślą o sportowcach, chcących jak najlepiej wzmocnić naturalny potencjał swoich możliwości.</p>','ostrovit-beta-alanina-800-mg-300-kapsulek-',NULL,NULL,NULL,'OstroVit Beta-Alanina 800 mg 300 kapsułek ',NULL,NULL,NULL,NULL),(985,1,1,NULL,'<p>OstroVit Supreme Pure Glucosamine to wysokiej jakości, nowoczesny preparat, składający się wyłącznie z jednej substancji, jaką jest siarczan glukozaminy. Produkt został rozdrobniony poprzez poddanie go procesowi mikronizacji, co pozwala na jeszcze lepszą wchłanialność. Żadnych wypełniaczy, konserwantów i barwników. Minimalizm składu opracowany z myślą o najbardziej wymagających konsumentach.</p>','ostrovit-glukozamina-210-g-naturalny