paratu zawiera kompleks, który zaspokaja potrzeby osoby dorosłej. Produkt szczególnie polecany osobom żyjącym aktywnie, zwłaszcza uprawiającym sport. Vit&Min to preparat złożony zawierający witaminy i minerały, posiadają wysoką zawartość biologiczną, co sprawia, że ​​są doskonale przyswajalne przez organizm i zapewniają wysoki poziom energii przez cały dzień. Suplement diety OstroVit to idealne rozwiązanie podczas intensywnego wysiłku fizycznego i umysłowego. Zawarty w preparacie kompleks witamin i minerałów pozwoli również na szybki powrót do sprawności fizycznej w okresie rekonwalescencji po przebytych chorobach i kontuzjach.</p>','ostrovit-100-vit-min-30-tabletek-',NULL,NULL,NULL,'OstroVit 100% Vit&Min 30 tabletek ',NULL,NULL,NULL,NULL),(991,1,1,NULL,'<p>OstroVit Pharma Na odporność to zestaw sześciu naturalnych ekstraktów roślinnych, które wspierają pracę układu immunologicznego. Preparat został wzbogacony o cynk - minerał wspomagający budowanie odporności organizmu.</p>','ostrovit-pharma-na-odpornosc-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Na odporność 60 kapsułek ',NULL,NULL,NULL,NULL),(992,1,1,NULL,'<p>OstroVit Pharma Witamina A+E to suplement diety w kroplach stworzony z myślą o kobietach i mężczyznach, którzy chcą zadbać o swój wygląd zewnętrzny. Składniki suplementu odżywiają i ochraniają skórę przed stresem oksydacyjnym, mogą przyczyniać się do widocznej poprawy wyglądu.</p>','ostrovit-pharma-witamina-a-e-w-kroplach-30-ml-',NULL,NULL,NULL,'OstroVit Pharma Witamina A+E w kroplach 30 ml ',NULL,NULL,NULL,NULL),(993,1,1,NULL,'<p>OstroVit Tryptofan to suplement diety oparty o zawartość wyłącznie jednej substancji, jaką jest L-tryptofan. Wysoka biodostępność oraz wysoki poziom farmaceutycznej mikronizacji sprawiają, że suplementy z linii Supreme Pure są najwyższej jakości. Produkt został stworzony z myślą o najbardziej wymagających konsumentach.</p>','ostrovit-tryptofan-200-g-naturalny',NULL,NULL,NULL,'OstroVit Tryptofan 200 g naturalny',NULL,NULL,NULL,NU