ia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty, dzięki którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze. </p>','ostrovit-pharma-methyl-b-complex-w-kroplach-30-ml-',NULL,NULL,NULL,'OstroVit Pharma Methyl B-complex w kroplach 30 ml ',NULL,NULL,NULL,NULL),(1006,1,1,NULL,'<p>OstroVit Morwa Biała VEGE to wegański suplement diety w kapsułkach HPMC (celulozowych), zawierający ekstrakt z liści morwy białej. 100% Vege Capsules to linia suplementów wyznaczająca najnowsze trendy zgodne z zamysłem idącym w parze wegańskiego stylu życia. Suplementy nie zawierają substancji oraz żadnych dodatków odzwierzęcych, co czyni je przyjaznymi dla wegan i wegetarian. OstroVit 100% VEGE CAPSULES to jakość, staranność oraz odpowiedź na oczekiwania naszych klientów.</p>','ostrovit-morwa-biala-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Morwa Biała VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1007,1,1,NULL,'<p>OstroVit Pharma Naturalna Witamina C z Dzikiej Róży to najwyższej jakości suplement diety w kapsułkach HPMC, który zawiera ekstrakt z owoców dzikiej róży standaryzowany na witaminę C. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze.</p>','ostrovit-pharma-naturalna-witamina-c-z-dzikiej-rozy-30-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Naturalna Witamina C z Dzikiej Róży 30 kapsułek ',NULL,NULL,NULL,NULL),(1008,1,1,NULL,'<p>OstroVit Hydro Out Diuretyk jest najwyższej jakości kompleksowym suplementem diety w kapsułkach, który zawiera standaryzowane składniki wspomagające Twoją dietę \"redukcyjną\" oraz ułatwiające pozbycie się nadmiaru wody z organizmu. OstroVit Hydro Out Diuretyk składający się z wysoce 