LL,NULL,NULL,'OstroVit Pharma Luteina 30 kapsułek ',NULL,NULL,NULL,NULL),(1024,1,1,NULL,'<p>OstroVit Arginina 1000 mg to suplement diety w kapsułkach zawierający tylko jeden składnik, jakim jest l-arginina. W trosce o jakość i zadowolenie konsumentów preparat został poddany najwyższemu poziomowi mikronizacji, co świadczy o jego doskonałości. Arginina jest uznawana za jeden z lepszych NO - BOOSTERÓW. Dzięki swoim właściwościom arginina będąca substratem syntezy tlenku azotu obniża ciśnienie krwi i polepsza transport tlenu do naszych komórek mięśniowych.</p>','ostrovit-arginina-1000-mg-300-kapsulek-',NULL,NULL,NULL,'OstroVit Arginina 1000 mg 300 kapsułek ',NULL,NULL,NULL,NULL),(1025,1,1,NULL,'<p>OstroVit EAA 1150 mg - to kompleks aminokwasów egzogennych oraz endogennych. Głównym zadaniem aminokwasów EAA jest zabezpieczenie mięśni przed katabolizmem oraz poprawa ich regeneracji po treningowej. W skład naszego produktu wchodzą aminokwasy BCAA (L-leucyna, L-walina, L-izoleucyna), L-lizyna, L-treonina, L-fenyloalanina, L-metionina, L-arginina, L-histydyna, L-tryptofan.</p>','ostrovit-eaa-1150-mg-150-kapsulek-',NULL,NULL,NULL,'OstroVit EAA 1150 mg 150 kapsułek ',NULL,NULL,NULL,NULL),(1026,1,1,NULL,'<p>OstroVit Magnesium Citrate to suplement diety w proszku opracowany przy wykorzystaniu wyłącznie pożądanego w tym wypadku cytrynianu magnezu. Produkt cechuje się wysoką biodostępnością, laboratoryjnym rozdrobnieniem, przy czym nie został okraszony zbędnymi konserwantami, aromatami czy przeciwzbrylaczami. Supreme Pure to linia dla osób wiedzących czego chcą, znających rezultaty i wyniki dzięki suplementacji. Prostota i najwyższa jakość w jednym - SUPREME PURE.</p>','ostrovit-cytrynian-magnezu-200-g-naturalny',NULL,NULL,NULL,'OstroVit Cytrynian Magnezu 200 g naturalny',NULL,NULL,NULL,NULL),(1027,1,1,NULL,'<p>OstroVit Magnesium Citrate to suplement diety w proszku zawierający magnez w formie cytrynianu magnezu o smaku lemoniady malinowej z miętą. Produkt cechuje się wysoką biodos