sunku 2:1:1. Do tych aminokwasów należą: leucyna, izoleucyna, walina. Powinny być one dostarczane do organizmu, ponieważ należą do tzw. aminokwasów egzogennych - aminokwasów, których ludzki organizm nie potrafi sam wytworzyć.</p>','ostrovit-bcaa-2-1-1-500-g-cytrynowy',NULL,NULL,NULL,'OstroVit BCAA 2-1-1 500 g cytrynowy',NULL,NULL,NULL,NULL),(1059,1,1,NULL,'<p>OstroVit Pharma Glucose System Aid to najwyższej jakości suplement diety w kapsułkach HPMC, który zawiera kompleks składników wspomagających prawidłowe funkcjonowanie gospodarki glukozowo-insulinowej. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze.</p>','ostrovit-pharma-glucose-system-aid-90-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Glucose System Aid 90 kapsułek ',NULL,NULL,NULL,NULL),(1060,1,1,NULL,'<p>Zestaw do treningu dłoni od marki OstroVit, to propozycja dla wszystkich, którzy poszukują praktycznych narzędzi do poprawy siły i sprawności. W skład zestawu chodzą: ściskacz do ręki z regulacją oporu, jajko kulkowe, trener palców oraz donut. Ich uniwersalny rozmiar jest odpowiedni dla wszystkich rozmiarów dłoni. Zestaw dostępny jest w czarnym kolorze.</p>','ostrovit-zestaw-do-cwiczen-rak-i-dloni-',NULL,NULL,NULL,'OstroVit Zestaw do ćwiczeń rąk i dłoni ',NULL,NULL,NULL,NULL),(1061,1,1,NULL,'<p>OstroVit KEEZA Flex Aid jest zestawem jedenastu składników aktywnych w wygodnej do podania postaci proszku do rozpuszczania w wodzie. Składniki zawarte w naszym preparacie wspomagają pracę i regenerację stawów i kości. Utrzymanie ich w dobrej kondycji pozwala na bezpieczeństwo i skuteczność codziennych treningów. Dlatego też nasz suplementy diety OstroVit KEEZA Flex Aid polecany jest szczególnie osobom regularnie uprawiającym aktywność fizyczną, by mogły kompleksowo zadbać o swój narząd