s-90-tabletek-',NULL,NULL,NULL,'OstroVit GABA plus 90 tabletek ',NULL,NULL,NULL,NULL),(1119,1,1,NULL,'<p>OstroVit Ostropest Plamisty VEGE to suplement diety w kapsułkach wegańskich zawierający mielone nasiona ostropestu plamistego co czyni go przyjaznym elementem diety każdego, kto dba o zdrowie i dobre samopoczucie. Sama kapsułka HPMC (hydroksypropylometylocelulozowa) oraz ekstrakt nie zawierają substancji pochodzenia zwierzęcego, więc suplement dedykowany jest do szerokiego grona odbiorców.  OstroVit 100% VEGE CAPSULES to jakość, staranność oraz odpowiedź na oczekiwania naszych klientów.</p>','ostrovit-ostropest-plamisty-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Ostropest Plamisty VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1120,1,1,NULL,'<p>OstroVit A-AKG SHOT to suplement diety w płynie. Zawiera substancje słodzące. Napój niegazowany oparty o alfa-ketoglutaran L-argininy. Suplement dedykowany jest sportowcom, którzy chcą przyśpieszyć regenerację po treningową, uzyskać znaczący efekt \"pompy mięśniowej\" oraz zwiększyć swoją siłę.</p>','ostrovit-a-akg-shot-80-ml-malinowo-cytrusowy',NULL,NULL,NULL,'OstroVit A-AKG Shot 80 ml malinowo-cytrusowy',NULL,NULL,NULL,NULL),(1121,1,1,NULL,'<p>OstroVit ADEK to suplement diety w tabletkach zawierający witaminy rozpuszczalne w tłuszczach: A, D, E oraz K. Witamina A pomaga zachować zdrową skórę, a także pomaga w utrzymaniu prawidłowego widzenia. Witamina D pomaga w utrzymaniu zdrowych kości i zębów. Witamina E pomaga w ochronie komórek przed stresem oksydacyjnym. Witamina K przyczynia się do prawidłowego krzepnięcia krwi oraz pomaga w utrzymaniu zdrowych kości.</p>','ostrovit-adek-200-tabletek-',NULL,NULL,NULL,'OstroVit ADEK 200 tabletek ',NULL,NULL,NULL,NULL),(1122,1,1,NULL,'<p>OstroVit Resveratrol VEGE to suplement diety w kapsułkach zawierający ekstrakt z korzenia rdestowca japońskiego standaryzowanego na 50% trans-resweratrolu. Sama kapsułka (HPMC - hydroksypropylometyloceluloza) oraz ekstrakt nie zawierają substancji pochod