d Aid łączy jod i tyrozynę, czyli dwie niezbędne substancje do syntezy produktów działania wydzielniczego tarczycy, a także selen i cynk, które są kofaktorami potrzebnymi do prawidłowego funkcjonowania tarczycy. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu.</p>','ostrovit-pharma-thyroid-aid-90-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Thyroid Aid 90 kapsułek ',NULL,NULL,NULL,NULL),(1156,1,1,NULL,'<p>OstroVit Żeń-szeń Syberyjski to preparat w tabletkach zawierający ekstrakt z żeń-szenia syberyjskiego. Żeń-szeń odnosi  wydolność zarówno fizyczną, jak i psychiczną. Ponadto, wspomaga procesy uczenia się i zapamiętywania, a także chroni nasz organizm przed czynnikami stresowymi. Osoby regularnie stosujące żeń-szeń, odczuwają więcej energii. Z tego względu sprawdzi się w stanach osłabienia, przemęczenia czy w procesie rekonwalescencji.</p>','ostrovit-zen-szen-syberyjski-120-tabletek-',NULL,NULL,NULL,'OstroVit Żeń-Szeń Syberyjski 120 tabletek ',NULL,NULL,NULL,NULL),(1157,1,1,NULL,'<p>OstroVit Braintus Focus Shot to unikalny suplement diety w płynie stworzony dla osób, które chcą pobudzić pracę mózgu. Oryginalna kompozycja składników aktywnych – kofeiny, L-teaniny, dwuwinianu choliny, witaminy B6 oraz ekstraktu z ashwagandhy – wspiera szereg procesów zachodzących w układzie nerwowym. Wypróbuj OstroVit Braintus Focus Shot – owocowy suplement w płynie o smaku soczystej borówki.</p>','ostrovit-braintus-focus-shot-100-ml-jagodowy',NULL,NULL,NULL,'OstroVit Braintus Focus Shot 100 ml jagodowy',NULL,NULL,NULL,NULL),(1158,1,1,NULL,'<p>OstroVit Guarana to naturalny preparat zawierający silnie pobudzający ekstrakt z nasion guarany pochodzącej z Ameryki Południowej (Paullinia Cupana). Jest jednym z najbogatszych źródeł kofeiny. Działa bardzo silnie mobilizująco na organizm, pobudza układ nerwowy, wspomaga pracę mózgu, poprawia pamięć i koncentrację, niweluje uczucie zmęczenia, dodaje sił witalnych.</p>','ostrovit-guarana-90-tabletek-',NULL,NULL,NULL,'OstroVit Guarana 90 tabletek ',NULL,NULL,NULL,NULL),(1159,1,1,NULL,'<p>OstroVit EAA to suplement diety w proszku, który uzupełnia naszą dietę w niezbędne aminokwasy egzogenne, których organizm człowieka nie jest w stanie samodzielnie syntetyzować. Produkt linii TRUE TASTE został opracowany przy użyciu najwyższej jakości surowców. OstroVit EAA w dwóch przepysznych smakach dla najbardziej wymagających konsumentów.</p>','ostrovit-eaa-400-g-grejpfrutowy',NULL,NULL,NULL,'OstroVit EAA 400 g grejpfrutowy',NULL,NULL,NULL,NULL),(1160,1,1,NULL,'<p>OstroVit CLA + Zielona Herbata + L-Karnityna to suplement diety w kapsułkach skierowany do osób aktywnych fizycznie, zawierając sprzężony kwas linolowy (CLA), ekstrakt z liści zielonej herbaty oraz L-karnitynę.</p>','ostrovit-cla---zielona-herbata---l-karnityna-90-kapsulek-',NULL,NULL,NULL,'OstroVit CLA + Zielona Herbata + L-Karnityna 90 kapsułek ',NULL,NULL,NULL,NULL),(1161,1,1,NULL,'<p>Cholina oraz inozytol, czyli składniki będące częścią kompleksu witamin z grupy B, wspierają pracę układu nerwowego, a także uczestniczą w metabolizmie tłuszczu i cholesterolu.</p>','ostrovit-cholina---inozytol-90-tabletek-',NULL,NULL,NULL,'OstroVit Cholina + Inozytol 90 tabletek ',NULL,NULL,NULL,NULL),(1162,1,1,NULL,'<p>OstroVit Vitamin D3 4000 + K2 LIMITED EDITION to suplement diety w postaci tabletek zawierający w swoim składzie kompozycję witaminy D oraz K, pochodzące z naturalnych surowców.</p>','ostrovit-witamina-d3-4000---k2-110-tabletek-',NULL,NULL,NULL,'OstroVit Witamina D3 4000 + K2 110 tabletek ',NULL,NULL,NULL,NULL),(1163,1,1,NULL,'<p>OstroVit Olej z wiesiołka to suplement diety o dużej ilości nienasyconych kwasów tłuszczowych oraz witaminy E, które wspierają szereg procesów zachodzących w organizmie. Olej zawiera aż 71% kwasu linolowego oraz 10% kwasu gamma-linolenowego. </p>','ostrovit-olej-z-wiesiolka-120-kapsulek-',NULL,NULL,NULL,'OstroVit Olej z Wiesiołka 120 kapsułek ',NULL,NULL,NULL,NULL),(1164,1,1,NULL,'<p>OstroVit VIT&MIN Shot to zestaw 19 witamin, minerałów i innych składników aktywnych, które wspierają zdrowe i prawidłowe funkcjonowanie organizmu na co dzień. Regularne przyjmowanie naszego suplementu pozwala utrzymać odpowiedni poziom mikroskładników. Szukasz suplementu, który zawiera dużą ilość potrzebnych składników aktywnych? Masz problemy z połykaniem tabletek? Wybierz nasz shot witaminowy o smaku wieloowocowym.</p>','ostrovit-vit-min-shot-100-ml-wieloowocowy',NULL,NULL,NULL,'OstroVit VIT&MIN Shot 100 ml wieloowocowy',NULL,NULL,NULL,NULL),(1165,1,1,NULL,'<p>OstroVit Witamina D3 2000 IU + K2 MK-7 + C + Zn to złożony suplement diety, składniki suplementu pomogą Ci zadbać o zdrowie oraz odporność organizmu. Dzięki unikalnemu doborowi składników aktywnych od dziś nie musisz przyjmować kilku suplementów jednocześnie.</p>','ostrovit-witamina-d3-2000-iu---k2-mk-7---c---zn-60-kapsulek-',NULL,NULL,NULL,'OstroVit Witamina D3 2000 IU + K2 MK-7 + C + Zn 60 kapsułek ',NULL,NULL,NULL,NULL),(1166,1,1,NULL,'<p>OstroVit Pharma Ferr Aid - to suplement diety, który w swoim składzie zawiera żelazo, witaminę C, witaminę B6, kwas foliowy oraz witaminę B12. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze.</p>','ostrovit-pharma-ferr-aid-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Ferr Aid 60 kapsułek ',NULL,NULL,NULL,NULL),(1167,1,1,NULL,'<p>OstroVit Błonnik Owsiany VEGE to wegański suplement diety w postaci błonnika owsianego otrzymywanego z naturalnych włókien owsianych. Preparat charakteryzuje się naturalnym, zbożowym smakiem, dzięki czemu dobrze sprawdzi się jako dodatek do jogurtu, owsianki czy domowych wypieków.</p>','ostrovit-blonnik-owsiany-vege-200-g-',NULL,NULL,NULL,'OstroVit Błonnik Owsiany VEGE 200 g ',NULL,NULL,NULL,NULL),(1168,1,1,NULL,'<p>OstroVit Omega 3 D3+K2 to suplement diety w miękkich kapsułkach typu softgel, zawierający kwasy tłuszczowe omega 3 (EPA i DHA) oraz witaminy D3, K2, a także D-alfa-tokoferol, czyli witaminę E.</p>','ostrovit-omega-3-d3-k2-180-kapsulek-',NULL,NULL,NULL,'OstroVit Omega 3 D3+K2 180 kapsułek ',NULL,NULL,NULL,NULL),(1169,1,1,NULL,'<p>OstroVit Fenugreek VEGE to suplement diety w kapsułkach wegańskich, zawierający ekstrakt z nasion kozieradki. Produkt powstał z myślą i przeznaczeniem dla wegetarian oraz wegan, gdyż produkt nie zawiera w składzie substancji pochodzenia zwierzęcego oraz główny składnik kapsułek, jakim zazwyczaj jest żelatyna został zastąpiony celulozą HPMC. Nasiona kozieradki to bogactwo minerałów, flawonoidów, fosfolipidów oraz witamin, które wspólnie pomagają cieszyć się dobrym samopoczuciem oraz zdrowiem.</p>','ostrovit-kozieradka-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Kozieradka VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1170,1,1,NULL,'<p>OstroVit Marine Collagen 1020 mg to suplement diety w kapsułkach zawierający peptydy kolagenu rybiego. Składniki suplementu wykazują działanie wspomagające piękny i zdrowy wygląd skóry.</p>','ostrovit-kolagen-morski-1020-mg-90-kapsulek-',NULL,NULL,NULL,'OstroVit Kolagen Morski 1020 mg 90 kapsułek ',NULL,NULL,NULL,NULL),(1171,1,1,NULL,'<p>OstroVit Biotin VEGE to suplement diety w kapsułkach wegańskich zawierający biotynę. Zawarta w suplemencie biotyna pomaga zachować zdrowe włosy oraz skórę. Przyczynia się do utrzymania prawidłowego metabolizmu makroskładników odżywczych oraz pomaga w prawidłowym funkcjonowaniu naszego układu nerwowego.</p>','ostrovit-biotyna-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Biotyna VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1172,1,1,NULL,'<p>OstroVit MSM to preparat będący źródłem metylosulfonylometanu, czyli związku siarki organicznej. Związek ten występuje w przyrodzie w wielu owocach, warzywach, jajach oraz mięsi