na przez sportowców, szczególnie tych o zwiększonym wysiłku fizycznym.</p>','ostrovit-tauryna-1500-mg-120-kapsulek-',NULL,NULL,NULL,'OstroVit Tauryna 1500 mg 120 kapsułek ',NULL,NULL,NULL,NULL),(1177,1,1,NULL,'<p>OstroVit Magnez Max + Vitamin to unikatowy kompleks witaminowo-minerałowy składający się z wysoce biodostępnych form związków magnezu oraz 10 witamin i składników mineralnych. Uzupełnianie niedoborów ww. minerałów jest szczególnie ważne w przypadku osób uprawiających sport, prowadzących aktywny tryb życia, ale również dla osób ceniących sobie dobre samopoczucie oraz dbających o homeostazę swojego organizmu.</p>','ostrovit-magnez-max---vitamin-60-tabletek-',NULL,NULL,NULL,'OstroVit Magnez MAX + Vitamin 60 tabletek ',NULL,NULL,NULL,NULL),(1178,1,1,NULL,'<p>OstroVit Inositol to suplement zawierający tylko jeden składnik, jakim jest mio-inozytol. Suplement nie zawiera zbędnych zbrylaczy, wypełniaczy i innych dodatków, a jego mikronizacja stoi na najwyższym poziomie. Idealna biodostępność została podyktowana wysokimi wymaganiami konsumentów. Produkt z Linii Supreme Pure gdzie wybierasz wyłącznie deklarowany, aktywny składnik.</p>','ostrovit-inozytol-200-g-naturalny',NULL,NULL,NULL,'OstroVit Inozytol 200 g naturalny',NULL,NULL,NULL,NULL),(1179,1,1,NULL,'<p>Sięgnij po porcję magnezu w trzech formach oraz witaminę B6 - składniki, które wspomagają prawidłowe funkcjonowanie organizmu.</p>','ostrovit-triple-magnesium---b6-p-5-p-90-kapsulek-',NULL,NULL,NULL,'OstroVit Triple Magnesium + B6 P-5-P 90 kapsułek ',NULL,NULL,NULL,NULL),(1180,1,1,NULL,'<p>OstroVit Immunity Shot to rewolucyjny suplement diety w formie pysznego malinowego shota witaminowego, który wspiera odporność organizmu. Produkt stanowi połączenie witamin i naturalnych ekstraktów roślinnych stymulujących układ immunologiczny do działania. Szukasz łatwego w stosowaniu suplementu którego składniki pomogą wesprzeć Twoją odporność? Masz dość łykania kilku tabletek i kapsułek na raz? Koniecznie spróbuj OstroVit Immunity Shot.</p>','ostrovit-immunity-shot-100-ml-malinowy',NULL,NULL,NULL,'OstroVit Immunity Shot 100 ml malinowy',NULL,NULL,NULL,NULL),(1181,1,1,NULL,'<p>OstroVit Triple Zinc to złożony suplement diety, dzięki któremu dostarczysz do orgazmu niezbędną dawkę cynku. Produkt łączy w sobie aż trzy wysoko przyswajalne rodzaje tego mikroskładnika, dzięki czemu bardzo dobrze się wchłania.</p>','ostrovit-triple-zinc-90-kapsulek-',NULL,NULL,NULL,'OstroVit Triple Zinc 90 kapsułek ',NULL,NULL,NULL,NULL),(1182,1,1,NULL,'<p>OstroVit Piperyna 95 VEGE to wysokiej klasy suplement diety w kapsułkach zawierający ekstrakt z owoców z czarnego pieprzu zawierający piperynę - alkaloid występujący naturalnie w pieprzu, który nie tylko nadaje mu ostry, piekący smak, ale również charakterystyczny aromat.</p>','ostrovit-piperyna-95-vege-100-kapsulek-',NULL,NULL,NULL,'OstroVit Piperyna 95 VEGE 100 kapsułek ',NULL,NULL,NULL,NULL),(1183,1,1,NULL,'<p>OstroVit Kolagen + Witamina C to najwyższej jakości suplement diety w proszku stworzony w smakowych wariantach linii OstroVit TRUE TASTE. Odżywka dedykowana dla osób aktywnych fizycznie oraz dla tych, którzy mają zwiększone zapotrzebowanie na kolagen oraz witaminę C. </p>','ostrovit-kolagen---witamina-c-200-g-ananasowy',NULL,NULL,NULL,'OstroVit Kolagen + Witamina C 200 g ananasowy',NULL,NULL,NULL,NULL),(1184,1,1,NULL,'<p>OstroVit Beta-Alanine Shot to suplement diety w płynie. Zawiera substancje słodzące. Napój niegazowany zawierający beta-alaninę (5 g/80 ml). Produkt przeznaczony jest dla osób, które chcą, aby ich treningi były dłuższe i efektywniejsze, chcą zwiększyć promowanie lipolizy (spalanie tkanki tłuszczowej) czy utrzymać idealną sylwetkę.</p>','ostrovit-beta-alanina-shot-80-ml-wisniowo-cytrynowo-limonkowy',NULL,NULL,NULL,'OstroVit Beta-Alanina Shot 80 ml wiśniowo-cytrynowo-limonkowy',NULL,NULL,NULL,NULL),(1185,1,1,NULL,'<p>OstroVit Vitamin K2 200 Natto MK-7 to suplement diety w tabletkach zawierający witaminę K, która przyczynia się do prawidłowego krzepnięcia krwi oraz pomaga w utrzymaniu zdrowych kości. OstroVit to 100% jakości oraz 100% satysfakcji z produktów po najniższych cenach. </p>','ostrovit-witamina-k2-200-natto-mk-7-90-tabletek-',NULL,NULL,NULL,'OstroVit Witamina K2 200 Natto MK-7 90 tabletek ',NULL,NULL,NULL,NULL),(1186,1,1,NULL,'<p>OstroVit Pharma PRO-60 BIOTIC LactoSpore to suplement diety w kapsułkach zawierający żywe kultury bakterii probiotycznych Bacillus coagulans MTCC 5856 LactoSpore opatentowane przez firmę Sabinsa. Probiotyk pozwala na utrzymanie zrównoważonej mikroflory jelitowej, a jego skuteczność została potwierdzona w badaniach klinicznych. Szczepy bakterii probiotycznych przyczyniają się do złagodzenia objawów wynikających z nieprawidłowej flory jelitowej.</p>','ostrovit-pharma-pro-60-biotic-lactospore-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma PRO-60 BIOTIC LactoSpore 60 kapsułek ',NULL,NULL,NULL,NULL),(1187,1,1,NULL,'<p>OstroVit Kolagen Morski z Kwasem Hialuronowym i Witaminą C to suplement diety w kapsułkach zawierający morski kolagen rybi, kwas hialuronowy oraz witaminę C. Produkt stworzony został z myślą o wszystkich osobach dbających o piękny i zdrowy wygląd skóry, a także  osób uprawiających sport, po kontuzjach sportowych lub intensywnym wysiłku fizycznym, w czasie rekonwalescencji po złamaniach oraz w celu regeneracji uszkodzonych stawów. Prawidłowa synteza kolagenu wymaga obecności witaminy C.</p>','ostrovit-kolagen-morski-z-kwasem-hialuronowym-i-witamina-c-120-kapsulek-',NULL,NULL,NULL,'OstroVit Kolagen Morski z Kwasem Hialuronowym i Witaminą C 120 kapsułek ',NULL,NULL,NULL,NULL),(1188,1,1,NULL,'<p>OstroVit Erytrytol to wysokiej jakości substancja słodząca, stosowana jako alternatywa dla tradycyjnego cukru stołowego (sacharozy). Indeks glikemiczny erytrytolu wynosi równe 0, dzięki czemu nie podnosi cukru we krwi. Doskonale sprawdzi się u osób dbających o zdrowie oraz dla tych, których ważne jest ograniczenie spożycia cukru w diecie.</p>','ostrovit-erytrytol-1000-g-naturalny',NULL,NULL,NULL,'OstroVit Erytrytol 1000 g naturalny',NULL,NULL,NULL,NULL),(1189,1,1,NULL,'<p>OstroVit Diet Rice Konjac to naturalny produkt, którego głównym składnikiem jest Glukomannan konnyak - rozpuszczalny w wodzie błonnik pochodzący z korzenia rośliny konnyak.</p>','ostrovit-diet-rice-konjac-400-g-',NULL,NULL,NULL,'OstroVit Diet Rice Konjac 400 g ',NULL,NULL,NULL,NULL),(1190,1,1,NULL,'<p>OstroVit Diet Spaghetti Konjac Noodles to naturalny produkt, którego głównym składnikiem jest Glukomannan konnyak - rozpuszczalny w wodzie błonnik pochodzący z korzenia rośliny konnyak.</p>','ostrovit-diet-spaghetti-konjac-noodles-400-g-',NULL,NULL,NULL,'OstroVit Diet Spaghetti Konjac Noodles 400 g ',NULL,NULL,NULL,NULL),(1191,1,1,NULL,'<p>OstroVit Pharma Omega 3-6-9 + ADEK VEGE w płynie to najwyższej jakości suplement diety w postaci oleju do stosowania doustnego, który zawiera kompleks kwasów OMEGA 3-6-9 i witamin A, D, E oraz K. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty, dzięki którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze. </p>','ostrovit-pharma-omega-3-6-9---adek-vege-120-ml-',NULL,NULL,NULL,'OstroVit Pharma Omega 3-6-9 + ADEK VEGE 120 ml ',NULL,NULL,NULL,NULL),(1192,1,1,NULL,'<p>OstroVit L-Karnityna to suplement diety będący źródłem najwyższej jakości winianu L-karnityny. Preparat przeznaczony dla osób aktywnych fizycznie, dążących do utraty wagi. L-karnityna jest jedną z najpopularniejszych substancji, z których korzystają konsumenci w czasie procesu odchudzania. Możemy znaleźć ją w pożywieniu w produktach mięsnych i mlecznych, stąd też osoby będące na diecie wegetariańskiej i wegańskiej powinny suplementować ten związek.</p>','ostrovit-l-karnityna-210-g-ananasowy',NULL,NULL,NULL,'OstroVit L-Karnityna 210 g ananasowy',NULL,NULL,NULL,NULL),(1193,1,1,NULL,'<p>OstroVit Ekstrakt z Guarany, składniki suplementu to naturalny energetyk i psychostymulant, dzięki którym zyskasz więcej energii i będziesz lepiej się koncentrować. Składniki suplementu pomogą Ci pokonać zmęczenie fizyczne oraz psychiczne, pobudzając Cię do działania.</p>','ostrovit-ekstrakt-z-guarany-100-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Guarany 100 g naturalny',NULL,NULL,NULL,NULL),(1194,1,1,NULL,'<p>OstroVit Witamina D3 400 IU Baby spray to suplement diety w płynie stworzony z myślą o najmłodszych członkach rodziny. Jedna dawka zawiera jedynie 400 IU, co stanowi zalecaną dzienną porcję witaminy D3 u dzieci w wieku do 6 miesięcy. Dodatkowo preparat zawiera witaminę E, która chroni organizm dziecka przed wolnymi rodnikami, wspiera narząd wzroku, a także ochrania układ krwionośny. </p>','ostrovit-pharma-witamina-d3-dla-niemowlat-400-iu-w-sprayu-30-ml-',NULL,NULL,NULL,'OstroVit Pharma Witamina D3 dla niemowląt 400 IU w sprayu 30 ml ',NULL,NULL,NULL,NULL),(1195,1,1,NULL,'<p>OstroVit Kolagen Morski + Olej MCT z kokosa 90 kapsułek to suplement diety w kapsułkach zawierający trzy składniki aktywne - morski kolagen rybi, olej MCT z oleju kokosowego oraz witaminę C. Produkt stworzony został z myślą o wszystkich osobach dbających o piękny i zdrowy wygląd skóry oraz uprawiających sport, po kontuzjach sportowych lub intensywnym wysiłku fizycznym,  w celu regeneracji uszkodzonych stawów. Dodatek oleju MCT z kokosa docenią także osoby dbające o sylwetkę.</p>','ostrovit-kolagen-morski---olej-mct-z-kokosa-90-kapsulek-',NULL,NULL,NULL,'OstroVit Kolagen Morski + Olej MCT z kokosa 90 kapsułek ',NULL,NULL,NULL,NULL),(1196,1,1,NULL,'<p>OstroVit PABA to suplement diety w kapsułkach którego składniki wykazują bardzo szerokie działanie prozdrowotne. Zastosowany w produkcie kwas para-aminobenzoesowy, znany również jako witamina B10, wspiera produkcję oraz przyswajanie wielu cennych składników odżywczych, w tym kwasu foliowego oraz innych witamin z grupy B.</p>','ostrovit-paba-vege-120-kapsulek-',NULL,NULL,NULL,'OstroVit PABA VEGE 120 kapsułek ',NULL,NULL,NULL,NULL),(1197,1,1,NULL,'<p>OstroVit Micellar Casein to suplement diety będący źródłem najwyższej jakości kazeiny micelarnej. To najskuteczniejsza i przynosząca najlepsze efekty forma kazeiny. Charakteryzuje się bardzo powolnym czasem wchłaniania, dzięki czemu zapewnia kilkugodzinny dopływ substancji budulcowych do tkanki mięśniowej. Kazeina ulega procesowi koagulacji w żołądku, co spowalnia jej trawienie i wydłuża czas wchłaniania.</p>','ostrovit-kazeina-micelarna-700-g-ciastek-z-kremem',NULL,NULL,NULL,'OstroVit Kazeina Micelarna 700 g ciastek z kremem',NULL,NULL,NULL,NULL),(1198,1,1,NULL,'<p>OstroVit Trawa Młodego Jęczmienia to roślinny suplement diety w proszku wykazujący silne właściwości przeciwutleniające. Młody zielony jęczmień jest pełen składników odżywczych, które wspierają funkcjonowanie organizmu na co dzień.</p>','ostrovit-trawa-mlodego-jeczmienia-vege-200-g-naturalny',NULL,NULL,NULL,'OstroVit Trawa Młodego Jęczmienia VEGE 200 g naturalny',NULL,NULL,NULL,NULL),(1199,1,1,NULL,'<p>OstroVit Kolagen Morski to innowacyjny suplement diety w proszku, który możesz z łatwością rozpuścić w wodzie lub soku. Produkt zawiera peptydy kolagenu morskiego, których budowa jest bardzo podobna do kolagenu ludzkiego, dzięki czemu środek bardzo dobrze się przyswaja. </p>','ostrovit-kolagen-morski-200-g-czarna-porzeczka',NULL,NULL,NULL,'OstroVit Kolagen Morski 200 g czarna porzeczka',NULL,NULL,NULL,NULL),(1200,1,1,NULL,'<p>OstroVit Pharma Witaminy Dla Kobiet kompleks witamin, składników mineralnych oraz ekstraktów i aminokwasów dla kobiet. Stworzony specjalnie z myślą o płci pięknej. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze.</p>','ostrovit-pharma-witaminy-dla-kobiet-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Witaminy Dla Kobiet 60 kapsułek ',NULL,NULL,NULL,NULL),(1201,1,1,NULL,'<p>OstroVit Dekstroza to suplement diety oparty o dekstrozę, która charakteryzuje się szybkim czasem wchłaniania w naszym ciele. Dekstroza to cukier prosty (izomer; D-glukoza), który sprawia, że w bardzo szybkim czasie jesteśmy w stanie dostarczyć organizmowi niezbędnego w danej chwili zastrzyku energii. Produkt jest dedykowany przede wszystkim sportowcom oraz osobom o zwiększonym zapotrzebowaniu na energię.</p>','ostrovit-dekstroza-500-g-',NULL,NULL,NULL,'OstroVit Dekstroza 500 g ',NULL,NULL,NULL,NULL),(1202,1,1,NULL,'<p>OstroVit Błonnik z Aronii VEGE to produkt z nowoczesnej linii suplementów roślinnych. W swoim składzie zawiera naturalny błonnik aroniowy pozyskiwany z suszonych wytłoków aroniowych. Błonnik jest otrzymywany w procesie mikronizacji, podczas której odpowiednio wyselekcjonowane części rośliny ulegają rozdrobnieniu mechanicznemu bez udziału chemicznych dodatków. Dzięki temu proszek ma łatwą do spożycia konsystencję oraz dużo łatwiej absorbuje wodę.</p>','ostrovit-blonnik-z-aronii-vege-200-g-',NULL,NULL,NULL,'OstroVit Błonnik z Aronii VEGE 200 g ',NULL,NULL,NULL,NULL),(1203,1,1,NULL,'<p>OstroVit Arginine to suplement zawierający składnik, jakim jest l-arginina. W trosce o jakość i zadowolenie konsumentów preparat został poddany najwyższemu poziomowi mikronizacji, co świadczy o jego doskonałości. Arginina jest uznawana za jeden z lepszych NO - BOOSTERÓW. Dzięki swoim właściwościom arginina będąca substratem syntezy tlenku azotu obniża ciśnienie krwi i polepsza transport tlenu do naszych komórek mięśniowych.</p>','ostrovit-arginina-500-g-multiwitamina',NULL,NULL,NULL,'OstroVit Arginina 500 g multiwitamina',NULL,NULL,NULL,NULL),(1204,1,1,NULL,'<p>Wałek do masażu z wypustkami od marki OstroVit, to uniwersalny produkt do automasażu po treningu oraz podczas rehabilitacji. Wałek wykonany jest z elastycznej pianki oraz posiada specjalne wypustki, które wywołują podobny efekt jak masaż prowadzony przez fizjoterapeutę. Dzięki piance korzystanie z wałka nie powoduje bólu, siniaków, a jednocześnie jest skuteczny.</p>','ostrovit-walek-do-masazu-roller-',NULL,NULL,NULL,'OstroVit Wałek do masażu roller ',NULL,NULL,NULL,NULL),(1205,1,1,NULL,'<p>OstroVit Shaker Premium to wyjątkowy shaker, w którym przygotujesz swoje ulubione odżywki, bez których nie utrzymasz swojej diety w ryzach, a dodatkowo dzięki pilbox znajdującego się pod spodem pojemnika, zabierzesz ze sobą na trening suplementy w kapsułkach i tabletkach. Czy to BCAA, czy WPC, wszystkie suplementy w proszku potrzebują odpowiedniego rozpuszczenia. Tutaj idealnie sprawdzi się OstroVit Shaker Premium.</p>','ostrovit-shaker-premium-450-ml-',NULL,NULL,NULL,'OstroVit Shaker Premium 450 ml ',NULL,NULL,NULL,NULL),(1206,1,1,NULL,'<p>Miernik tkanki tłuszczowej OstroVit to fałdomierz służący do ręcznego, samodzielnego i precyzyjnego pomiaru tkanki tłuszczowej.</p>','ostrovit-fat-caliper-',NULL,NULL,NULL,'OstroVit Fat Caliper ',NULL,NULL,NULL,NULL),(1207,1,1,NULL,'<p>OstroVit Shaker Sport 700 ml to seria standardowych, kolorowych, niezawodnych shakerów, które od dzisiaj będziesz mógł zabrać ze sobą gdzie tylko zechcesz. Czy to ciężkie treningi siłowe, wypad w góry, a może zwykły spacer - wystarczy nalać wody lub skomponować swojego ulubionego shake\'a proteinowego, który zastąpi Twój posiłek, któremu często trzeba poświęcić sporo czasu na przygotowanie.</p>','ostrovit-shaker-sport-700-ml--',NULL,NULL,NULL,'OstroVit Shaker Sport 700 ml  ',NULL,NULL,NULL,NULL),(1208,1,1,NULL,'<p>OstroVit Beta-Alanine to znakomity suplement znajdujący zastosowanie podczas ciężkich sesji treningowych. Mikronizowany preparat stworzony z myślą o sportowcach, chcących jak najlepiej wzmocnić naturalny potencjał swoich możliwości.</p>','ostrovit-beta-alanina-500-g-grejpfrutowy',NULL,NULL,NULL,'OstroVit Beta-Alanina 500 g grejpfrutowy',NULL,NULL,NULL,NULL),(1209,1,1,NULL,'<p>OstroVit Pharma Bison Beard to najwyższej jakości suplement diety w kapsułkach HPMC, który zawiera kompleks specjalnie dobranych składników w tym witamin, minerałów oraz ekstraktów roślinnych, które wspierają porost owłosienia na twarzy, podnoszą efektywność regeneracyjną mieszków włosowych oraz pomagają zachować zdrowe włosy i skórę. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze.</p>','ostrovit-pharma-bison-beard-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Bison Beard 60 kapsułek ',NULL,NULL,NULL,NULL),(1210,1,1,NULL,'<p>To bardzo uniwersalny sprzęt sportowy, który świetnie nadaje się do ćwiczeń na siłowni, salach sportowych, na świeżym powietrzu jak i w domu. Gumy treningowe nadają się zarówno do rozgrzewki, jak i ćwiczeń siłowych ujędrniających ciało i wzmacniających dolne partie ciała. Można nimi dowolnie owijać zarówno ręce, nogi, jak i tułów. Ich niewielki rozmiar i ciężar pozwala wygodnie trenować w każdym miejscu. Dzięki oporowi, który stawiają, mięśnie są zmuszone do wzmożonej pracy, przez co zajęcia z gumą treningową nie należą do trudnych i oferują stałe napięcie mięśni.</p>','ostrovit-guma-treningowa-opor-25-7-kg-',NULL,NULL,NULL,'OstroVit Guma Treningowa Opór 2,5-7 kg ',NULL,NULL,NULL,NULL),(1211,1,1,NULL,'<p>OstroVit ALC to bardzo wydajny suplement diety w proszku zawierający czystą acetylo-L-karnitynę, czyli naturalną substancję odżywczą, wspierającą funkcjonowanie układu nerwowego oraz mięśni. Składniki suplementu świetnie sprawdzą się u osób, które odczuwają obciążenie psychiczne, chcą zgubić zbędne kilogramy lub prowadzą aktywny tryb życia.\n\n</p>','ostrovit-acetylo-l-karnityna-200-g-naturalny',NULL,NULL,NULL,'OstroVit Acetylo L-Karnityna 200 g naturalny',NULL,NULL,NULL,NULL),(1212,1,1,NULL,'<p>OstroVit Expander to zestaw pięciu gum treningowych. Produkt, który może znaleźć szeroki zakres zastosowań podczas zróżnicowanych form aktywności fizycznej. </p>','ostrovit-zestaw-5-gum-oporowych-do-cwiczen-ekspander-',NULL,NULL,NULL,'OstroVit Zestaw 5 gum oporowych do ćwiczeń Ekspander ',NULL,NULL,NULL,NULL),(1213,1,1,'','<p>OstroVit WPC80.EU Good Morning to najwyższej jakości koncentrat białka serwatkowego, wzbogacony o L-glutaminę, taurynę, L-tyrozynę i kofeinę. Jest doskonałym źródłem pełnowartościowego białka zwierzęcego oraz aminokwasów niezbędnych do budowy włókien mięśniowych.</p>','ostrovit-wpc80eu-good-morning-700-g-cappuccino','','','','OstroVit WPC80.eu Good Morning 700 g cappuccino','','','',''),(1214,1,1,NULL,'<p>Podwójna piłka do masażu od marki OstroVit to uniwersalny produkt do automasażu po treningu jak również w czasie zabiegu rehabilitacyjnego. Jego szerokie zastosowanie może wykorzystać każdy, kto zmaga się z bólami, napięciem mięśni po treningu. Może być stosowana również przez fizjoterapeutów i rehabilitantów.</p>','ostrovit-podwojna-pilka-do-masazu-',NULL,NULL,NULL,'OstroVit Podwójna Piłka do Masażu ',NULL,NULL,NULL,NULL),(1215,1,1,NULL,'<p>OstroVit Carbo to najwyższej jakości węglowodanowy suplement diety, która charakteryzuje się bardzo krótkim czasem ich wchłaniania. Umożliwia dostarczanie stopniowo odpowiedniej ilości energii w okresie okołotreningowym. Preparat szczególnie polecany jest dla sportowców uprawiających sporty siłowe. Dodatkowo produkt został wzbogacony w niezbędne minerały, witaminy, a także substancje polepszające ukrwienie jak L-arginina i Beta-alanina.</p>','ostrovit-carbo-1000-g-arbuzowy',NULL,NULL,NULL,'OstroVit Carbo 1000 g arbuzowy',NULL,NULL,NULL,NULL),(1216,1,1,NULL,'<p>OstroVit Deska do pompek to wielofunkcyjne urządzenie do ćwiczeń wzmacniających mięśnie klatki piersiowej, brzucha, rąk i pleców. Możliwość ułożenia uchwytów w wielu kombinacjach, pozwala na różnorodny trening, przy użyciu jednego sprzętu. Pozwala to na wykonywanie pompek i innych ćwiczeń na bardziej zaawansowanym poziomie. Świetnie sprawdzi się u osób początkujących, jak również bardziej zaawansowanych.</p>','ostrovit-deska-do-pompek-',NULL,NULL,NULL,'OstroVit Deska do pompek ',NULL,NULL,NULL,NULL),(1217,1,1,NULL,'<p>OstroVit Aqua Kick ADEK to nowoczesny suplement diety w formie saszetki, dzięki któremu dostarczysz do swojego organizmu niezbędną dzienną dawkę witamin rozpuszczalnych w tłuszczach. Kompleks ADEK, czyli nic innego jak witaminy A, D, E i K, zapewniają szerokie spektrum działania, a ich niedobory mogą być odczuwalne w całym organizmie.</p>','ostrovit-aqua-kick-adek-300-g-',NULL,NULL,NULL,'OstroVit Aqua Kick ADEK 300 g ',NULL,NULL,NULL,NULL),(1218,1,1,NULL,'<p>OstroVit Pharma Witamina D3 4000 IU to wegański suplement diety w postaci sprayu, który pozwoli Ci w szybki i bezproblemowy sposób zapewnić organizmowi niezbędną dzienną dawkę witaminy D. Produkt został wzbogacony o witaminę E wykazującą właściwości antyoksydacyjne oraz wspierający przyswajanie witamin olej MCT z nasion olejowca gwinejskiego. Składniki zawarte w suplemencie pozwolą ci cieszyć się mocnymi kośćmi i zębami, mieć piękną i gładką skórę, uchronić się przed infekcjami, ograniczyć ilość wolnych rodników w organizmie oraz wesprzeć układ krwionośny w codziennej pracy.</p>','ostrovit-pharma-witamina-d3-4000-iu-vege-w-sprayu-30-ml-',NULL,NULL,NULL,'OstroVit Pharma Witamina D3 4000 IU VEGE w sprayu 30 ml ',NULL,NULL,NULL,NULL),(1219,1,1,NULL,'<p>OstroVit Uchwyty do pompek to akcesoria do ćwiczeń, przy których użyciu minimalizujesz ucisk dłoni, nadgarstków i łokci, jaki występuje podczas wykonywania klasycznych pompek. Stosowanie tego typu uchwytów wyraźnie odciąży Twoje stawy i tym samym zminimalizuje ryzyko kontuzji.</p>','ostrovit-uchwyty-do-pompek-',NULL,NULL,NULL,'OstroVit Uchwyty do pompek ',NULL,NULL,NULL,NULL),(1220,1,1,NULL,'<p>OstroVit OATS & WHEY to produkt w postaci proszku będący połączeniem owsa wraz z białkiem serwatkowym. OATS & WHEY to idealny zamiennik śniadania lub innego posiłku, który dostarczy Ci energii na resztę dnia. Wystarczy dodać mleko lub wodę, by móc cieszyć się pożywnym posiłkiem. Wysoka zawartość białka tworzy produkt kompletny. Białko przyczynia się do wzrostu masy mięśniowej oraz pomaga w jej utrzymaniu. Doskonale uzupełnia Twoją codzienną dietę oraz zdrowy tryb życia. Zawiera substancję słodzącą.</p>','ostrovit-oats---whey-1000-g-czekoladowy',NULL,NULL,NULL,'OstroVit OATS & WHEY 1000 g czekoladowy',NULL,NULL,NULL,NULL),(1221,1,1,NULL,'<p>Zestaw czterech gum do ćwiczeń OstroVit to produkt, który może znaleźć szeroki zakres zastosowań podczas zróżnicowanych form aktywności fizycznej. Gumy oporowe mogą sprostać oczekiwaniom najbardziej wymagających klientów, którzy postanowią wykorzystać je do treningu siłowego, rehabilitacji bądź rozgrzewki. Stanowią one doskonały sposób na zwiększenie oporu podczas tradycyjnego treningu. Do zestawu dołączony jest worek.</p>','ostrovit-gumy-treningowe-zestaw-4-szt---worek-',NULL,NULL,NULL,'OstroVit Gumy Treningowe zestaw 4 szt + worek ',NULL,NULL,NULL,NULL),(1222,1,1,NULL,'<p>OstroVit PILL BOX to prosty, ale jak najbardziej funkcjonalny pojemnik na Twoją codzienną porcję tabletek/kapsułek!	\nZapomnij raz na zawsze o noszeniu zbędnych opakowań z suplementami\n	Dzięki swoim wymiarom zmieści się nawet w kieszeni\n	5 przegródek na 5 różnych form suplementów. Kapsułki?? Tabletki?? To Ty decydujesz!\n	Uniwersalny, transparentny kolor\n	Logo OstroVit na froncie pudełka\n</p>','ostrovit-pill-box-bez-logo-',NULL,NULL,NULL,'OstroVit Pill Box BEZ LOGO ',NULL,NULL,NULL,NULL),(1223,1,1,NULL,'<p>OstroVit Pharma Immune Aid to najwyższej jakości suplement diety w kapsułkach HPMC opracowany z myślą o tych, którzy dbając o swój układ odpornościowy chcą mieć wszystko w swoich rękach. To doskonały kompleksowy suplement, który w swoim składzie zawiera niezbędne, najważniejsze naturalne substancje immunomodulujące do wsparcia swojego układu odpornościowego. OstroVit Pharma to linia, która