kakanka Metalowa 3 m ',NULL,NULL,NULL,NULL),(1248,1,1,NULL,'<p>OstroVit Carbo to najwyższej jakości węglowodanowy suplement diety, która charakteryzuje się bardzo krótkim czasem ich wchłaniania. Umożliwia dostarczanie stopniowo odpowiedniej ilości energii w okresie okołotreningowym. Preparat szczególnie polecany jest dla sportowców uprawiających sporty siłowe. Dodatkowo produkt został wzbogacony w niezbędne minerały, witaminy, a także substancje polepszające ukrwienie jak L-arginina i Beta-alanina.</p>','ostrovit-carbo-3000-g-arbuzowy',NULL,NULL,NULL,'OstroVit Carbo 3000 g arbuzowy',NULL,NULL,NULL,NULL),(1249,1,1,NULL,'<p>Butelka na wodę od Firmy OstroVit, to funkcjonalny bidon, który łączy w sobie trwałość i funkcjonalność, przez co sprawdza się na treningu, rowerze czy spacerze. Wykorzystanie nowoczesnych materiałów zapewnia optymalne właściwości do przechowywania płynów. Dzięki wygodnemu ustnikowi szybko i łatwo ugasisz pragnienie! Butelka dostępna jest w 4 wariantach kolorystycznych - zielonym, żółtym, różowym i czarnym.</p>','ostrovit-butelka-na-wode-600-ml-',NULL,NULL,NULL,'OstroVit Butelka na wodę 600 ml ',NULL,NULL,NULL,NULL),(1250,1,1,NULL,'<p>OstroVit Zielona Kawa to najwyższej jakości suplement diety w tabletkach zawierający ekstrakt z ziaren zielonej kawy. Każda tabletka zawiera w składzie 500 mg czystego ekstraktu, który charakteryzuje się wysoką zawartością kofeiny, dzięki czemu preparat ma silne właściwości pobudzające i stymulujące organizm. Dzięki wysokiej zawartości kwasu chlorogenowego skutecznie wspomaga odchudzanie i podnosi termogenezę całego ciała.</p>','ostrovit-zielona-kawa-90-tabletek-',NULL,NULL,NULL,'OstroVit Zielona Kawa 90 tabletek ',NULL,NULL,NULL,NULL),(1251,1,1,NULL,'<p>OstroVit L-Karnityna 1250 mg to suplement diety z najnowszej linii firmy OstroVit będący źródłem najwyższej jakości winianu L-karnityny. Preparat przeznaczony dla osób aktywnych fizycznie, dążących do utraty wagi. L-karnityna jest jedną z najpopularniejszych substancji, z których korzystają konsumenci w czasie procesu odchudzania. Możemy znaleźć ją w pożywieniu w produktach mięsnych i mlecznych, stąd też osoby będące na diecie wegetariańskiej i wegańskiej powinny suplementować ten związek. Podczas stosowania L-karnityny odczuwalny jest wzrost energii.</p>','ostrovit-l-karnityna-1250-mg-60-kapsulek-',NULL,NULL,NULL,'OstroVit L-Karnityna 1250 mg 60 kapsułek ',NULL,NULL,NULL,NULL),(1252,1,1,NULL,'<p>OstroVit HMB 750 to najwyższej jakości, nowoczesny preparat, składający się wyłącznie z jednej substancji zamkniętej w kapsułkach linii Supreme Capsules. Supreme Capsules - minimalizm składu oraz najwyższe porcje danego aminokwasu. Produkty stworzone z myślą o najlepszych.</p>','ostrovit-hmb-750-mg-300-kapsulek-',NULL,NULL,NULL,'OstroVit HMB 750 mg 300 kapsułek ',NULL,NULL,NULL,NULL),(1253,1,1,NULL,'<p>OstroVit Freak Fighter to kompleksowa odżywka przedtreningowa o smaku owoców tropikalnych wzbogacona kompleksem witamin z grupy B. Znajdziesz w niej cały zbiór substancji, które pozwolą Ci odczuć nową jakość treningów. Dzięki składnikom suplementu  będziesz mieć nie tylko więcej siły oraz osiągniesz lepsze rezultaty podczas ćwiczeń, ale także zadbasz o prawidłowe funkcjonowanie mięśni oraz układu nerwowego.</p>','ostrovit-freak-fighter-500-g-tropikalnego-ponczu',NULL,NULL,NULL,'OstroVit Freak Fighter 500 g tropikalnego ponczu',NULL,NULL,NULL,NULL),(1254,1,1,NULL,'<p>OstroVit Pharma Decorem For Men - kompleks witamin, składników mineralnych oraz ekstraktów i aminokwasów dla mężczyzn. OstroVit Pharma to linia, która jakość surowców, farmaceutyczną staranność produkcji oraz wszystkie komponenty dzięki, którym powstaje suplement, stawia na pierwszym miejscu. OstroVit Pharma to bezwzględnie elitarne suplementy dla konsumentów wiedzących co jest dla nich najważniejsze.</p>','ostrovit-pharma-decorem-for-men-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Decorem For Men 60 kapsułek ',NULL,NULL,NULL,NULL),(1255,1,1,NULL,'<p>OstroVit Afrykańskie Mango VEGE to suplement diety w wegańskich kapsułkach zawierający ekstrakt z nasion afrykańskiego mango (Irvingia gabonensis L.) DER 10:1. Składniki zawarte w OstroVit Afrykańskie Mango wspomagają proces lipolizy, czyli spalania tłuszczu w naszym organizmie, oraz wykazuje działanie prozdrowotne, takie jak obniżanie ciśnienia tętniczego oraz całkowitego cholesterolu. Promuje również rozpad trójglicerydów i procesy biochemiczne związane z obniżaniem udziału lipoprotein o niskiej gęstości, czyli popularnego \"złego cholesterolu\" LDL.</p>','ostrovit-afrykanskie-mango-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Afrykańskie Mango VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1256,1,1,NULL,'<p>OstroVit Omega 3-6-9 to suplement diety w kapsułkach zawierający kwasy tłuszczowe omega 3 (EPA, DHA, ALA), Omega 6 (LA) i Omega 9 (OA), wzbogacone o witaminę E. Kwasy omega 3, omega 6 oraz omega 9 zaliczane są do niezbędnych nienasyconych kwasów tłuszczowych. Bardzo istotna jest odpowiednia proporcja wszystkich kwasów nienasyconych z tego względu, iż każdy z nich pełni odmienną rolę w organizmie.</p>','ostrovit-omega-3-6-9-30-kapsulek-',NULL,NULL,NULL,'OstroVit Omega 3-6-9 30 kapsułek ',NULL,NULL,NULL,NULL),(1257,1,1,NULL,'<p>OstroVit Kwercetyna VEGE to nowoczesny suplement diety w kapsułkach wegańskich zawierający dihydrokwercetynę (Sophora Japonica L. - Perełkowiec japoński). OstroVit Quercetin VEGE został opracowany z myślą o osobach kierujących się zasadą weganizmu lub wegetarianizmu, nie zawiera żadnych substancji i związków pochodzenia zwierzęcego, a ekstrakt został zamknięty w specjalne kapsułki HPMC (hydroksypropylometylocelulozowe). Suplementy z linii 100% VEGE CAPSULES to produkty przeznaczone tak naprawdę dla wszystkich, którzy szukają danego ekstraktu i chcą nim uzupełnić swoją dietę, a biorąc pod uwagę osoby, które nie spożywają produktów pochodzenia zwierzęcego, każdy będzie zadowolony. OstroVit to dbałość o szczegóły, jakość i zadowolenie każdego klienta bez wyjątku.</p>','ostrovit-kwercetyna-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Kwercetyna VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1258,1,1,NULL,'<p>OstroVit Krill Oil to suplement diety w żelowych kapsułkach zawierający olej z kryla antarktycznego. To mieszanina nienasyconych kwasów tłuszczowych EPA i DHA z grupy Omega-3, fosfolipidów oraz astaksantyny - karotenoidu uważanego za jeden z najsilniejszych antyoksydantów (przeciwutleniaczy). Jego wysoka biodostępność dyktuje zawartość kwasów tłuszczowych w postaci fosfolipidu (kwasy tłuszczowe z grupą fosforanową). To suplement idealny dla każdego, kto wykazuje zwiększone zapotrzebowanie na NNKT, czyli niezbędne nienasycone kwasy tłuszczowe.</p>','ostrovit-olej-z-kryla-60-kapsulek-',NULL,NULL,NULL,'OstroVit Olej z Kryla 60 kapsułek ',NULL,NULL,NULL,NULL),(1259,1,1,NULL,'<p>OstroVit Maca VEGE to suplement diety w wegańskich kapsułkach, zawierający ekstrakt z korzenia maca. Produkt został stworzony z myślą o osobach, które prowadzą aktywny tryb życia i o tych, którzy na co dzień zmuszeni są do intensywnego wysiłku psychicznego. Kompleksowe przeznaczenie żeń-szenia peruwiańskiego, uważanego za jeden z produktów superfoods, zostało poparte licznymi badaniami.</p>','ostrovit-maca-vege-60-caps-',NULL,NULL,NULL,'Ostrovit Maca VEGE 60 caps ',NULL,NULL,NULL,NULL),(1260,1,1,NULL,'<p>OstroVit Triple Ginseng VEGE  to wegański suplement diety zawierający w swoim składzie pięć różnych ekstraktów roślinnych. Połączenie żeń-szenia właściwego z żeń-szeniem syberyjskim, ashwagandhą, guaraną oraz czarnym pieprzem środek zapewni Ci szybki zastrzyk energii.</p>','ostrovit-triple-ginseng-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Triple Ginseng VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1261,1,1,NULL,'<p>OstroVit Chlorella to suplement diety, który został opracowany na bazie glonów należących do jednokomórkowych mikroalg z gromady zielenic. Chlorella to proteiny, wielonienasycone kwasy tłuszczowe oraz bogactwo witamin, minerałów i fitozwiązków, które działają prozdrowotnie na organizm człowieka. Produkowane metodą Broken Cell Walls (pęknięte ściany komórkowe).</p>','ostrovit-chlorella-90-tabletek-',NULL,NULL,NULL,'OstroVit Chlorella 90 tabletek ',NULL,NULL,NULL,NULL),(1262,1,1,NULL,'<p>OstroVit Chlorella to suplement diety, który został opracowany na bazie glonów należących do jednokomórkowych mikroalg z gromady zielenic. Produkt ostatnimi czasy zaliczany jest jako superfoods dzięki swemu plejotropowemu działaniu na organizm ludzki. Chlorella to bogactwo witamin, minerałów oraz fitozwiązków, które działają prozdrowotnie na organizm człowieka. Produkowane metodą Broken Cell Walls (pęknięte ściany komórkowe).</p>','ostrovit-chlorella-1000-tabletek-',NULL,NULL,NULL,'OstroVit Chlorella 1000 tabletek ',NULL,NULL,NULL,NULL),(1263,1,1,NULL,'<p>OstroVit Hemp Oil to suplement diety bazujący na naturalnym oleju z konopi tłoczonym na zimno. Nieocenione właściwości prozdrowotne oraz bogactwo składników odżywczych oleju konopnego sprawiły, że jest to obecnie jedna z najbardziej pożądanych substancji stosowanych w pielęgnacji ciała oraz codziennej suplementacji.</p>','ostrovit-olej-konopny-90-kapsulek-',NULL,NULL,NULL,'OstroVit Olej Konopny 90 kapsułek ',NULL,NULL,NULL,NULL),(1264,1,1,NULL,'<p>OstroVit Astaxanthin FORTE to suplement diety najwyższej jakości, zawierający naturalny ekstrakt astaksantyny. Został stworzony z myślą o osobach, dla których zdrowie, młody wygląd, oraz dobre samopoczucie są szczególnym priorytetem.</p>','ostrovit-astaksantyna-forte-90-kapsulek-',NULL,NULL,NULL,'OstroVit Astaksantyna FORTE 90 kapsułek ',NULL,NULL,NULL,NULL),(1265,1,1,NULL,'<p>OstroVit Luteina FORTE to suplement diety w kapsułkach zawierający naturalną luteinę wzbogaconą o zeaksantynę. Jak się obecnie uważa, luteina jest jednym z najważniejszych składników wpływających na ochronę oczu. To organiczny związek chemiczny należący do ksantofili - barwników roślinnych z grupy karotenoidów, działający jak filtr absorbujący niebezpieczne promieniowanie i eliminujący wolne rodniki. Organizm ludzki nie potrafi wytwarzać tej substancji samodzielnie, dlatego należy ja dostarczać w odpowiedniej ilości wraz z pożywieniem lub na drodze suplementacji.</p>','ostrovit-luteina-forte-30-kapsulek-',NULL,NULL,NULL,'OstroVit Luteina FORTE 30 kapsułek ',NULL,NULL,NULL,NULL),(1266,1,1,NULL,'<p>OstroVit Supreme Pure Gaba to najwyższej klasy suplement, który zawiera wyłącznie czysty kwas gamma-aminomasłowy. Idealna biodostępność produktu to zaleta, która jest ostatnimi czasy tak bardzo pożądana wśród konsumentów. Mikronizacja w owym preparacie została przeprowadzona na najwyższym poziomie, tworząc produkt o wzorowej jakości.</p>','ostrovit-gaba-200-g-naturalny',NULL,NULL,NULL,'OstroVit GABA 200 g naturalny',NULL,NULL,NULL,NULL),(1267,1,1,NULL,'<p>OstroVit Fiber Psyllium Vege - to produkt będący źródłem naturalnego błonnika pozyskanego z ziaren babki płesznik oraz łuski babki jajowatej. Po spożyciu nasiona babki jajowatej oraz babki płesznik pęcznieją w jelitach, dając uczucie sytości. Produkt stanowi naturalne źródło błonnika pokarmowego.</p>','ostrovit-blonnik-witalny-700-g-naturalny',NULL,NULL,NULL,'OstroVit Błonnik Witalny 700 g naturalny',NULL,NULL,NULL,NULL),(1268,1,1,NULL,'<p>OstroVit Pharma Na Uspokojenie to suplement diety, który w swoim składzie zawiera składniki wykazujące działanie uspokajające. Połączenie kwasu gamma-aminomasłowego z L-teaniną oraz trzema naturalnymi ekstraktami roślinnymi - z korzenia ashwagandhy, wąkroty azjatyckiej oraz różeńca górskiego skutecznie redukuje stres i ogranicza napięcie. </p>','ostrovit-pharma-na-uspokojenie-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Na Uspokojenie 60 kapsułek ',NULL,NULL,NULL,NULL),(1269,1,1,NULL,'<p>OstroVit Theanine + Tyrosine VEGE to wegański suplement diety w kapsułkach HPMC (celulozowych), zawierający miks dwóch aminokwasów o działaniu prokognitywnym, L-tyrozyny i L-teaniny. 100% Vege Capsules to linia suplementów wyznaczająca najnowsze trendy zgodne z zamysłem idącym w parze wegańskiego stylu życia. Suplementy nie zawierają substancji oraz żadnych dodatków odzwierzęcych, co czyni je przyjaznymi dla wegan i wegetarian. OstroVit 100% VEGE CAPSULES to jakość, staranność oraz odpowiedź na oczekiwania naszych klientów.</p>','ostrovit-l-teanina---l-tyrozyna-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit L-Teanina + L-Tyrozyna VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1270,1,1,NULL,'<p>OstroVit Glutation VEGE to najwyższej jakości suplement diety w kapsułkach celulozowych HPMC (hydroksypropylometyloceluloza) zawierający zredukowany L-glutation. Każda kapsułka zawiera w składzie 200 mg zredukowanego glutationu, wykazując działanie antyoksydacyjne (przeciwutleniające) wobec każdej komórki w naszym organizmie. OstroVit 100% VEGE CAPSULES to jakość, staranność oraz odpowiedź na oczekiwania naszych klientów.</p>','ostrovit-glutation-vege-90-kapsulek-',NULL,NULL,NULL,'Ostrovit Glutation VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1271,1,1,NULL,'<p>OstroVit Pharma Adapto Aid to naturalny suplement diety, którego składniki wykazują działanie adaptogenne. W każdej kapsułce preparatu znajdziesz zestaw sześciu ekstraktów roślinnych, które stymulują układ nerwowy do wytężonej pracy. </p>','ostrovit-pharma-adapto-aid-60-kapsulek-',NULL,NULL,NULL,'OstroVit Pharma Adapto Aid 60 kapsułek ',NULL,NULL,NULL,NULL),(1272,1,1,NULL,'<p>OstroVit Silica Bamboo VEGE to nowoczesny suplement diety w wegańskich kapsułkach zawierający standaryzowany ekstrakt z bambusa. To produkt przeznaczony dla osób dorosłych, które chcą uzupełnić swoją codzienną dietę w krzemionkę.</p>','ostrovit-ekstrakt-z-bambusa-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Ekstrakt z Bambusa VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1273,1,1,NULL,'<p>OstroVit Bakopa Drobnolistna VEGE jest suplementem diety w kapsułkach wegańskich (HPMC), zawierającym ekstrakt z bakopy drobnolistnej. Bacopa monnieri to roślina od lat wykorzystywana w tradycyjnej ajurwedzie, szeroko znana i ceniona obok Ashwaga