L,NULL,'OstroVit Kurczak w sosie meksykańskim z ryżem 420 g ',NULL,NULL,NULL,NULL),(1315,1,1,NULL,'<p>OstroVit Kurczak w sosie curry z ryżem to pełnowartościowe gotowe danie, które możesz zabrać ze sobą praktycznie wszędzie. Nasze danie zawiera wyłącznie naturalne składniki – bez barwników i konserwantów. W przeciwieństwie do większości dań pakowanych ma również niską zawartość tłuszczu i cukru. \nUwielbiasz dobrze doprawione dania? Nie masz czasu na przygotowanie obiadu? Szukasz pożywnego posiłku, który możesz zjeść w pracy lub bezpośrednio po treningu? OstroVit Kurczak w sosie curry z ryżem sprawdzi się we wszystkich przypadkach!</p>','ostrovit-kurczak-w-sosie-curry-z-ryzem-300-g-',NULL,NULL,NULL,'OstroVit Kurczak w sosie curry z ryżem 300 g ',NULL,NULL,NULL,NULL),(1316,1,1,NULL,'<p>OstroVit Danie VEGE z kuskusem perłowym i ciecierzycą to gotowe danie wegańskie o zdrowym składzie wyróżniającym się niską zawartością tłuszczów nasyconych oraz cukrów. Kasza sprawdzi się świetnie w przypadku osób poszukujących pełnowartościowego posiłku, który jest bardzo łatwy w przygotowaniu w praktycznie każdych warunkach. Poszukujesz wegańskiego posiłku, który szybko Cię nasyci? Wybierz OstroVit Danie VEGE z kuskusem perłowym i ciecierzycą.\n\n\n\nGotowe danie wegańskie inspirowane kuchnią orientalną\nNasze wegańskie danie roślinne z kaszą kuskus oraz cieciorką to idealna propozycja dla wszystkich miłośników kuchni orientalnej. Dzięki dodatkowi aromatycznego imbiru, gram masala oraz curry posiłek ma unikalny aromat nawiązujący do potraw charakterystycznych dla kuchni Wschodu.\nOstroVit Danie VEGE z kuskusem perłowym i ciecierzycą zawiera wyłącznie naturalne składniki pochodzenia roślinnego. Kuskus perłowy oraz cieciorka charakteryzują się bardzo wysoką zawartością białka, a także są wartościowym źródłem wielu cennych składników odżywczych, m.in. witamin, minerałów oraz błonnika. Dzięki temu nasze danie nie tylko świetnie smakuje, ale również może wspierać pracę organizmu. Wybierz wegańskie kaszotto z ciecierzycą, jeżeli:\n\n\nposzukujesz szybkiego sposobu na smaczny i zdrowy posiłek\nuwielbiasz kuchnię orientalną\njesteś na diecie wegańskiej\nograniczasz spożycie cukrów oraz tłuszczów nasyconych\nchcesz wzbogacić swoją dietę w naturalne składniki\n\nWłaściwości\nNasze gotowe danie wegańskie inspirowane orientalnymi smakami to idealna propozycja dla osób, które są w ciągłym biegu lub nie lubią gotować. Przygotowanie dania zajmuje maksymalnie kilka minut. Kaszę możesz też zjeść na zimno. Produkt nie wymaga przechowywania w lodówce, dzięki czemu możesz zabrać go ze sobą, gdzie tylko chcesz.\nNajważniejsze cechy produktu:\n\nNATURALNY SKŁAD – Nasze danie stanowi połączenie naturalnych składników – kaszy kuskus, warzyw, ziół i przypraw – które zapewniają mu oryginalny smak. Danie nie zawiera konserwantów, barwników i wzmacniaczy smaku.\nCENNE ŹRÓDŁO BIAŁKA – Zarówno kuskus perłowy, jak i ciecierzyca stanowią bogate źródło białka. Danie polecane jest w szczególności osobom aktywnym, sportowcom oraz wszystkim tym, którzy są na diecie redukcyjnej.\nDUŻO BŁONNIKA  –Wysoka zawartość błonnika sprawia, że nasze danie z kaszą kuskus świetnie nasyca i ogranicza uczucie głodu na długi czas. Dodatkowo wspiera pracę układu pokarmowego.\nWEGAŃSKA FORMUŁA –Wybrane przez nas składniki są w 100% wegańskie. Danie z kaszą kuskus i ciecierzycą sprawdzi się zatem również w przypadku osób, które nie jedzą mięsa lub ograniczają jego spożycie.\n\n</p>','ostrovit-danie-vege-z-kuskusem-perlowym-i-ciecierzyca-280-g-',NULL,NULL,NULL,'OstroVit Danie VEGE z kuskusem perłowym i ciecierzycą 280 g ',NULL,NULL,NULL,NULL),(1317,1,1,NULL,'<p>OstroVit Danie VEGE z kaszą bulgur i kiełkami to pyszne i pożywne danie wegańskie inspirowane smakami kuchni włoskiej. Dzięki połączeniu bogatej w witaminy, błonnik i inne składniki odżywcze kaszy bulgur z warzywami, pestkami dyni, czterema rodzajami kiełków warzywnych oraz aromatycznymi przyprawami, nasze danie wyróżnia się niezwykle zdrowym 