 napojów i ciast.</p>','ostrovit-miod-wielokwiatowy-1000-g-',NULL,NULL,NULL,'OstroVit Miód Wielokwiatowy 1000 g ',NULL,NULL,NULL,NULL),(1338,1,1,NULL,'<p>OstroVit Xylitol to wysokiej jakości produkt, który zawiera alkoholowy cukier, który może być beztrosko używany jako substytut cukru białego (sacharozy). Naturalnie występuje w niektórych owocach, warzywach oraz innych roślinach np. korze brzozy. Wykazuje działanie przeciwpróchniczne, bakteriostatycznie, wspomaga przyswajanie wapnia w organizmie, czyli wpływa na mineralizację kości.</p>','ostrovit-ksylitol-750-g-naturalny',NULL,NULL,NULL,'OstroVit Ksylitol 750 g naturalny',NULL,NULL,NULL,NULL),(1339,1,1,NULL,'<p>Naturalny miód powstający dzięki ciężkiej pracy pszczół, które wytwarzają go latem z pyłku  kwiatów lipy. Nie zawiera zbędnych dodatków i konserwantów. Ma charakterystyczny, słodki smak oraz zapach, który doskonale pasuje do przygotowywania posiłków. Jest odpowiedni dla wegan i wegetarian. Cechuje go barwa od zielonkawożółtej do jasnobursztynowej, a po skrystalizowaniu od bladożółtej do złocistożółtej oraz wysoka gęstość, co sprawia, że świetnie sprawdza się zarówno jako polewa, jak i jeden ze składników dań. Dzięki naturalnemu pochodzeniu zawiera ogromną liczbę składników takich jak olejki eteryczne, enzymy, związki flawonowe i goryczowe czy garbniki.</p>','ostrovit-miod-lipowy-1000-g-',NULL,NULL,NULL,'OstroVit Miód Lipowy 1000 g ',NULL,NULL,NULL,NULL),(1340,1,1,NULL,'<p>Miód nektarowy słonecznikowy OstroVit pochodzi z późnych zbiorów pszczelich, w których zdecydowanie przeważają pyłki pochodzące z kwiatów słonecznika. Jest to miód całkowicie naturalny zawierający ogromną ilość składników aktywnych, które przyczyniają się do utrzymania zdrowia oraz dobrego samopoczucia. Produkt ma delikatny, słodki smak i zapach, przez co nie przytłacza pozostałych składników potraw, z którymi jest podawany. Jego barwa jest intensywnie żółta, a konsystencja to gęsta ciecz, dzięki czemu jest odpowiedni zarówno do polewania, jak również dodawania do środka różnorodnych dań. Produkt jest odpowiedni dla wegan i wegetarian.</p>','ostrovit-miod-slonecznikowy-1000-g-',NULL,NULL,NULL,'OstroVit Miód Słonecznikowy 1000 g ',NULL,NULL,NULL,NULL),(1341,1,1,NULL,'<p>OstroVit Lody wysokobiałkowe to pyszny proteinowy deser stworzony z myślą o osobach, które dbają o linię, są na diecie lub zwracają szczególną uwagę na jakość spożywanych posiłków. Nasze lody przygotujesz samodzielnie w domu, zawsze wtedy, gdy najdzie Cię ochota na coś słodkiego. Poszukujesz smacznych lodów z dobrym składem? Chcesz bez wyrzutów sumienia zjeść upragniony deser? Postaw na nasz rewolucyjny produkt – OstroVit Lody wysokobiałkowe o smaku truskawkowym.</p>','ostrovit-lody-wysokobialkowe-400-g-',NULL,NULL,NULL,'OstroVit Lody wysokobiałkowe 400 g ',NULL,NULL,NULL,NULL),(1342,1,1,NULL,'<p>Naturalny miód powstający dzięki ciężkiej pracy pszczół, które wytwarzają go latem z pyłku  kwiatów lipy. Nie zawiera zbędnych dodatków i konserwantów. Ma charakterystyczny, słodki smak oraz zapach, który doskonale pasuje do przygotowywania posiłków. Jest odpowiedni dla wegan i wegetarian. Cechuje go barwa od zielonkawożółtej do jasnobursztynowej, a po skrystalizowaniu od bladożółtej do złocistożółtej oraz wysoka gęstość, co sprawia, że świetnie sprawdza się zarówno jako polewa, jak i jeden ze składników dań. Dzięki naturalnemu pochodzeniu zawiera ogromną liczbę składników takich jak olejki eteryczne, enzymy, związki flawonowe i goryczowe czy garbniki.</p>','ostrovit-miod-lipowy-500-g-',NULL,NULL,NULL,'OstroVit Miód Lipowy 500 g ',NULL,NULL,NULL,NULL),(1343,1,1,NULL,'<p>Miód wielokwiatowy wytwarzany naturalnie w okresie wiosennym, letnim i jesiennym swój niepowtarzalny smak zawdzięcza unikalnemu połączeniu pyłków kwiatowych. Przy każdych zbiorach ten rodzaj miodu ma inne proporcje czynników chemicznych wpływających na jego prozdrowotne działanie. To właśnie dzięki ich połączeniu i różnorodności uważany jest za najbardziej uniwersalny miód, który łączy w sobie zalety wszystkich pozostałych. Jest odpowiedni dla wegan i wegetarian. Może być stosowany jako składnik dań, deserów lub słodzik do napojów i ciast.</p>','ostrovit-miod-wielokwiatowy-500-g-',NULL,NULL,NULL,'OstroVit Miód Wielokwiatowy 500 g ',NULL,NULL,NULL,NULL),(1344,1,1,NULL,'<p>OstroVit Protein Pancakes to pyszne, pożywne naleśniki na bazie mąki owsianej i koncentratu białka serwatkowego, bez dodatku cukru. Naleśniki Wysokobiałkowe OstroVit to idealna propozycja na szybkie, zdrowe i lekkie śniadanie lub kolację, słodką przekąskę czy odżywczy posiłek po treningu. Doskonale smakują prosto z patelni, bez żadnych dodatków, ale można je urozmaicić świeżymi owocami, jogurtem, słodką polewą, miodem, dżemem czy masłem orzechowym.</p>','ostrovit-protein-pancakes-2000-g-czekoladowy',NULL,NULL,NULL,'OstroVit Protein Pancakes 2000 g czekoladowy',NULL,NULL,NULL,NULL),(1345,1,1,NULL,'<p>W trosce o zdrowie naszych klientów, produkty przez nas wytwarzane poddawane są regularnym badaniom w niezależnym akredytowanym laboratorium, w celu zapewnienia i utrzymania najwyższej jakości.</p>','ostrovit-chlorella-1000-tabletek---ostrovit-spirulina-1000-tabletek-',NULL,NULL,NULL,'OstroVit Chlorella 1000 tabletek + OstroVit Spirulina 1000 tabletek ',NULL,NULL,NULL,NULL),(1346,1,1,NULL,'<p>OstroVit THE BAR. to wysokobiałkowy baton, który idealnie zaspokoi Twoją chęć sięgnąć po coś słodkiego. To znakomita przekąska proteinowa, którą możesz zabrać ze sobą wszędzie gdzie tylko chcesz. Wrzuć go do torby lub plecaka, aby w wolnej chwili móc rozkoszować się jego wybornym smakiem. OstroVit THE BAR. dostępny w trzech przepysznych wersjach: czekolada, wanilia oraz truskawka. W zależności od wariantu baton został okraszony ciemną lub białą polewą, która nadaje mu charakter i idealnie wkomponowuje się w całość, tworząc prawdziwe opus magnum wśród przekąsek.</p>','ostrovit-the-bar-60-g-truskawkowy',NULL,NULL,NULL,'OstroVit THE BAR. 60 g truskawkowy',NULL,NULL,NULL,NULL),(1347,1,1,NULL,