serów, naleśników, placków oraz dietetycznych przekąsek u osób, które chcą ograniczyć codzienne spożycie kalorii. Poszukujesz słodkiego dodatku do dań i deserów, który nie tuczy? A może jesteś na diecie niskowęglowodanowej i doskwiera Ci brak słodyczy? Wypróbuj naszą najnowszą serię sosów bez dodatku  cukru. Wybierz swój ulubiony smak i ciesz się nim bez wyrzutów sumienia. Jedna porcja sosu to zaledwie 0,5 kalorii!</p>','ostrovit-sos-o-smaku-wisniowym-350-g-wisniowy',NULL,NULL,NULL,'OstroVit Sos o smaku wiśniowym 350 g wiśniowy',NULL,NULL,NULL,NULL),(1351,1,1,NULL,'<p>OstroVit Strawberry Flavoured Sauce to pyszny sos o smaku truskawkowym bez dodatku cukru! Produkt idealnie sprawdzi się jak dodatek do deserów, naleśników, placków oraz dietetycznych przekąsek u osób, które chcą ograniczyć codzienne spożycie kalorii. Poszukujesz słodkiego dodatku do dań i deserów, który nie tuczy? A może jesteś na diecie niskowęglowodanowej i doskwiera Ci brak słodyczy? Wypróbuj naszą najnowszą serię sosów bez dodatku cukru. Wybierz swój ulubiony smak i ciesz się nim bez wyrzutów sumienia. Jedna porcja sosu to zaledwie 0,6 kalorii!</p>','ostrovit-sos-o-smaku-truskawkowym-350-g-truskawkowy',NULL,NULL,NULL,'OstroVit Sos o smaku truskawkowym 350 g truskawkowy',NULL,NULL,NULL,NULL),(1352,1,1,NULL,'<p>OstroVit Salted Caramel Flavoured Sauce to pyszny sos o smaku słonego karmelu bez dodatku cukru! Produkt idealnie sprawdzi się jak dodatek do deserów, naleśników, placków oraz dietetycznych przekąsek u osób, które chcą ograniczyć codzienne spożycie kalorii. Poszukujesz słodkiego dodatku do dań i deserów, który nie tuczy? A może jesteś na diecie niskowęglowodanowej i doskwiera Ci brak słodyczy? Wypróbuj naszą najnowszą serię sosów bez dodatku cukru. Wybierz swój ulubiony smak i ciesz się nim bez wyrzutów sumienia. Jedna porcja sosu to zaledwie 1 kilokaloria!</p>','ostrovit-sos-o-smaku-slonego-karmelu-300-g-slonego-karmelu',NULL,NULL,NULL,'OstroVit Sos o smaku słonego karmelu 300 g słonego karme