umienia. Jedna porcja sosu to zaledwie 1 kilokaloria!</p>','ostrovit-sos-o-smaku-czekoladowo-orzechowym-300-g-czekoladowo-orzechowy',NULL,NULL,NULL,'OstroVit Sos o smaku czekoladowo-orzechowym 300 g czekoladowo-orzechowy',NULL,NULL,NULL,NULL),(1356,1,1,NULL,'<p>OstroVit Sos Barbecue to jedyny w swoim rodzaju wytrawny sos do mięsa z grilla bez cukru oraz tłuszczu! Specjalnie opracowana formuła z dodatkiem błonnika bambusowego zapewnia idealną konsystencję sosu, a starannie dobrane przyprawy i aromaty sprawiają, że sos idealnie komponuje się z mięsami oraz rybami. Uwielbiasz dania z grilla, ale nie chcesz łączyć ich z wysokokalorycznymi dodatkami? Dzięki produktowi OstroVit Sos Barbecue nie musisz już martwić się o to, że Twój ulubiony sos podbija kaloryczność dań.</p>','ostrovit-sos-barbecue-300-g-barbecue',NULL,NULL,NULL,'OstroVit Sos Barbecue 300 g barbecue',NULL,NULL,NULL,NULL),(1357,1,1,NULL,'<p>OstroVit Protein Pancakes to pyszne, pożywne naleśniki na bazie mąki owsianej i koncentratu białka serwatkowego, bez dodatku cukru. Naleśniki wysokobiałkowe OstroVit to idealna propozycja na szybkie, zdrowe i lekkie śniadanie lub kolację, słodką przekąskę czy odżywczy posiłek po treningu. Doskonale smakują prosto z patelni, bez żadnych dodatków, ale można je urozmaicić świeżymi owocami, jogurtem, słodką polewą, miodem, dżemem czy masłem orzechowym.</p>','ostrovit-protein-pancakes-1000-g-malinowy',NULL,NULL,NULL,'OstroVit Protein Pancakes 1000 g malinowy',NULL,NULL,NULL,NULL),(1358,1,1,NULL,'<p>OstroVit Olej rzepakowy w sprayu 250 ml to innowacyjny maślany olej kuchenny. Zamknięty w butelce z wygodnym sprayem olej rzepakowy o smaku masła sprawdzi się w wielu różnych sytuacjach. Możesz użyć go przy smażeniu, grillowaniu oraz pieczeniu. Produkt pozwoli Ci w łatwy sposób kontrolować ilość zużytego oleju.</p>','ostrovit-olej-rzepakowy-w-sprayu-250-ml-',NULL,NULL,NULL,'OstroVit Olej rzepakowy w sprayu 250 ml ',NULL,NULL,NULL,NULL),(1359,1,1,NULL,'<p>OstroVit Cream of Rice to seria kleików ryżowych, teraz także o smaku naturalnym. Nasz nowy produkt w szybki i łatwy sposób pozwoli Ci uzupełnić odpowiedni poziom węglowodanów w diecie. Kleik został stworzony przede wszystkim z myślą o osobach poszukujących pomysłu na smaczną przekąskę po treningu. Kleik OstroVit Cream of Rice o smaku naturalnym jest odpowiedni dla wegan i zawiera jedynie naturalnie występujące cukry.</p>','ostrovit-kleik-ryzowy-1000-g-naturalny',NULL,NULL,NULL,'OstroVit Kleik ryżowy 1000 g naturalny',NULL,NULL,NULL,NULL),(1360,1,1,NULL,'<p>OstroVit Creametto Vege 350 g is a natural vegan cream with a cocoa-nut flavor. No extra sugar, no palm oil or no powdered milk, thanks to which it is a perfect vegan snack which you can grab any time of the day!</p>','ostrovit-creametto-vege-350-g-kakaowo-orzechowy-vege',NULL,NULL,NULL,'OstroVit Creametto Vege 350 g kakaowo-orzechowy vege',NULL,NULL,NULL,NULL),(1361,1,1,NULL,'<p>OstroVit Creametto 350 g to naturalny krem, który występuje w sześciu pysznych wariantach smakowych. Krem nie zawiera dodatkowego cukru i oleju palmowego, dzięki czemu stanowi idealną przekąskę, po którą można sięgnąć o dowolnej porze dnia!</p>','ostrovit-creametto-350-g-czekoladowy',NULL,NULL,NULL,'OstroVit Creametto 350 g czekoladowy',NULL,NULL,NULL,NULL),(1362,1,1,NULL,'<p>OstroVit Peanut Butter + Honey to doskonały i unikalny produkt, powstający z myślą o najbardziej wymagających smakoszach, którzy dbają o smukłą sylwetkę, uprawiają sport, a także dla tych, którzy ograniczają szkodliwy nadmiar soli czy cukru w swojej diecie. Głęboki, pełny, smak orzechów ziemnych oraz dodatek smacznego miodu doskonale komponuje się jako dodatek na słodko i słono. To prawdziwa bomba cennych kwasów tłuszczowych, protein i minerałów. Głębia smaku, 100% satysfakcji i gwarancja najwyższej jakości.</p>','ostrovit-krem-orzechowy-z-miodem-500-g-',NULL,NULL,NULL,'OstroVit Krem Orzechowy z Miodem 500 g ',NULL,NULL,NULL,NULL),(1363,1,1,NULL,'<p>OstroVit Erytrytol to wysokiej jakości subst