łatwe dostosowanie dawki produktu do wieku dziecka. Poszukujesz witaminy C dla swojego dziecka w formie kropli doustnych? Koniecznie wypróbuj suplement diety OstroVit Pharma Witamina C dla dzieci.</p>','ostrovit-pharma-vitamin-c-kids-drops-30-ml-',NULL,NULL,NULL,'OstroVit Pharma Vitamin C KIDS drops 30 ml ',NULL,NULL,NULL,NULL),(1367,1,1,NULL,'<p>OstroVit Tri-Creatine Malate to najwyższej jakości suplement diety będący źródłem jabłczanu kreatyny. Jest to połączenie kreatyny z kwasem jabłkowym w stosunku 1:3. Suplement dostępny jest w wersji smakowej i naturalnej. Mikronizacja produktu stoi na najwyższym poziomie. Idealna biodostępność została podyktowana wysokimi wymaganiami konsumentów.</p>','ostrovit-jablczan-kreatyny-300-g-cytrynowy',NULL,NULL,NULL,'OstroVit Jabłczan Kreatyny 300 g cytrynowy',NULL,NULL,NULL,NULL),(1368,1,1,NULL,'<p>OstroVit FLEX REGEN to suplement diety opracowany przy użyciu najwyższej jakości surowców. Poszczególne komponenty wspólnie tworzą produkt o idealnej kompozycji. Znajdzie szczególne zastosowanie u sportowców oraz osób prowadzących aktywny tryb życia.</p>','ostrovit-flex-regen-400-g-truskawkowo-kiwi',NULL,NULL,NULL,'OstroVit Flex Regen 400 g truskawkowo-kiwi',NULL,NULL,NULL,NULL),(1369,1,1,NULL,'<p>OstroVit Cordyceps VEGE to wegański suplement diety na bazie ekstraktu z grzyba maczużnika chińskiego o wysokiej zawartości polisacharydów. Składniki suplementu wykazują działanie adaptogenne, tzn. wspiera prawidłowe mechanizmy adaptacji oraz odporność i wydolność organizmu.</p>','ostrovit-kordyceps-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Kordyceps VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1370,1,1,NULL,'<p>OstroVit Chaga VEGE to grzybowy suplement diety, będący bogatym źródłem wielu substancji potrzebnych na co dzień Twojemu organizmowi. Chaga zawiera w sobie witaminy, minerały, enzymy oraz polisacharydy, dzięki czemu sprawia, że Twój organizm lepiej funkcjonuje.Chaga jest również znana ze swoich właściwości wzmacniających kondycję oraz wydolność.</p>','ostrovit-chaga-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Chaga VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1371,1,1,NULL,'<p>OstroVit Reshi VEGE to grzybowy suplement diety w postaci ekstraktu z drobno zmielonego owocnika grzyba lakownicy żółtawej. Reishi od ponad dwóch tysięcy lat ceniony jest za swoje właściwości relaksacyjne oraz wspomagające odporność i funkcje układu krążenia. Regularne spożywanie grzybów Reishi pozwoli Ci wzmocnić swój układ immunologiczny.</p>','ostrovit-reishi-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Reishi VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1372,1,1,NULL,'<p>OstroVit Ekstrakt z Bakopy Drobnolistnej to naturalny suplement diety w formie proszku którego składniki wykazują szerokie działanie prozdrowotne. Do najważniejszych korzyści wynikających ze stosowania bakopy zaliczyć możemy wsparcie funkcji kognitywnych, np. poprawę pamięci czy koncentracji.</p>','ostrovit-ekstrakt-z-bakopy-drobnolistnej-50-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Bakopy Drobnolistnej 50 g naturalny',NULL,NULL,NULL,NULL),(1373,1,1,NULL,'<p>OstroVit Szyszka Chmielu VEGE to wegański suplement diety przeznaczony dla osób, które pragną w naturalny sposób zadbać o zdrowie swojego organizmu. Składniki suplementu wykazują działanie antyoksydacyjne, dzięki czemu zwalcza wolne rodniki.</p>','ostrovit-szyszka-chmielu-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Szyszka Chmielu VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1374,1,1,NULL,'<p>OstroVit Ekstrakt z Lakownicy Żółtawej to grzybowy suplement diety stanowiący bogate źródło różnorodnych składników aktywnych. Lakownica żółtawa, znana również pod nazwą reishi, jest powszechnie stosowana w Azji, gdzie używa się jej do leczenia wielu różnych przypadłości. </p>','ostrovit-reishi-extract-50-g-',NULL,NULL,NULL,'OstroVit Reishi Extract 50 g ',NULL,NULL,NULL,NULL),(1375,1,1,NULL,'<p>OstroVit Czarny Bez VEGE to zestaw 90 łatwych do połknięcia kapsułek zawierających bogaty w polifenole i antocyjany ekstrakt z Sambucus nigra L. Składniki zawarte w suplemencie wykazują działanie antybakteryjne i przeciwwirusowe, dzięki czemu świetnie sprawdzi się w codziennej profilaktyce. </p>','ostrovit-czarny-bez-vege-90-kapsulek-',NULL,NULL,NULL,'OstroVit Czarny Bez VEGE 90 kapsułek ',NULL,NULL,NULL,NULL),(1376,1,1,NULL,'<p>OstroVit Ekstrakt z Jeżówki Purpurowej to naturalny suplement diety, dzięki składnikom suplementu zadbasz o odporność oraz prawidłowe funkcjonalnie układu oddechowego. Połączenie dwóch rodzajów ekstraktu z jeżówki - ekstraktu standaryzowanego na 4% polifenoli oraz ekstraktu standaryzowanego na 4% kwasu cykoriowego, gwarantuje stałą ilość substancji aktywnych, co sprawia, że skuteczność preparatu jest zawsze taka sama.</p>','ostrovit-ekstrakt-z-jezowki-purpurowej-50-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Jeżówki Purpurowej 50 g naturalny',NULL,NULL,NULL,NULL),(1377,1,1,NULL,'<p>OstroVit Sleep Well Shot to zestaw aż sześciu składników aktywnych w postaci shota o smaku jagodowym. Nasz kolejny innowacyjny z serii shotów OstroVit preparat zawiera  między innymi melatoninę, witaminę B6, kwas GABA, aminokwasy oraz ekstrakt z szyszek chmielu. Poszukujesz suplementu diety,  którego składniki wspomagają zasypianie i poprawiają jakość snu? Postaw na OstroVit Sleep Well Shot 100 ml - niewielki napój o wielkiej mocy!</p>','ostrovit-sleep-well-shot-25-x-100-ml-jagodowy',NULL,NULL,NULL,'OstroVit Sleep Well Shot 25 x 100 ml jagodowy',NULL,NULL,NULL,NULL),(1378,1,1,NULL,'<p>OstroVit Sex Pro Shot to zestaw aż siedmiu składników aktywnych w postaci shota o smaku grejpfrutowym. Nasz kolejny innowacyjny z serii shotów OstroVit preparat, zawiera między innymi cynk, selen, witaminę B5, aminokwasy oraz ekstrakt z żeń-szenia właściwego i korzenia maca. Poszukujesz suplementu diety,  którego składniki wspomagają utrzymywanie poziomu libido i ogólnej sprawności seksualnej na właściwym poziomie? Postaw na OstroVit Sex Pro Shot 100 ml - niewielki napój o wielkiej mocy!</p>','ostrovit-sex-pro-shot-25-x-100-ml-grejpfrutowy',NULL,NULL,NULL,'OstroVit Sex Pro Shot 25 x 100 ml grejpfrutowy',NULL,NULL,NULL,NULL),(1379,1,1,NULL,'<p>OstroVit Pump Nitro Shot 100 ml to przedtreningówka w postaci shota o smaku grejpfrutowym, który dostarczy Ci energii i siły podczas aktywności fizycznej. Nasz owocowy shot stanowi połączenie aż 10 różnych składników aktywnych. Regularnie uprawiasz sport i poszukujesz suplementu diety, którego składniki wspomogą wydolność i wytrzymałość Twojego organizmu, a także podniosą efektywność treningu? Postaw na OstroVit Pump Nitro Shot – niewielki napój o wielkiej mocy!</p>','ostrovit-pump-nitro-shot-25-x-100-ml-',NULL,NULL,NULL,'OstroVit Pump Nitro Shot 25 x 100 ml ',NULL,NULL,NULL,NULL),(1380,1,1,NULL,'<p>OstroVit Ekstrakt z Żurawiny to naturalny suplement diety, dzięki któremu dostarczysz do organizmu wiele cennych substancji odżywczych. Składniki suplementu wykazują działanie prozdrowotne, w szczególności w profilaktyce chorób układu moczowego, owoce żurawiny zawdzięczają wysokiej zawartości witamin A, C i E, beta-karotenu, minerałów, luteiny, steroli oraz polifenoli.</p>','ostrovit-ekstrakt-z-zurawiny-100-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Żurawiny 100 g naturalny',NULL,NULL,NULL,NULL),(1381,1,1,NULL,'<p>OstroVit Ekstrakt z Berberysu to wszechstronny suplement diety w formie ekstraktu z korzenia berberysu. Do właściwości składników zawartych w suplemencie zaliczyć możemy m.in. regulacje poziomu insuliny we krwi, wsparcie układu pokarmowego oraz działanie uspokajające.</p>','ostrovit-ekstrakt-z-berberysu-100-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Berberysu 100 g naturalny',NULL,NULL,NULL,NULL),(1382,1,1,NULL,'<p>OstroVit Ashwagandha VEGE jest suplementem w kapsułkach wegańskich, co czyni go przyjaznym elementem Sama kapsułka oraz ekstrakt nie zawierają substancji pochodzenia zwierzęcego, więc suplement dedykowany jest do szerokiego grona odbiorców. Ekstrakt z korzenia Witanii ospałej, czyli Ashwagandhy jest standaryzowany na ponad 7% witanolidów co przy zawartości ekstraktu równego 700 mg opiewa na ich 50 mg zawartość. Jeden z najsilniejszych na rynku tego typu suplementów to nie tylko witanolidy, ale również zawartość witaferyny A oraz pozostałych alkaloidów. OstroVit 100% VEGE CAPSULES to jakość, staranność oraz odpowiedź na oczekiwania naszych klientów.</p>','ostrovit-ashwagandha-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Ashwagandha VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1383,1,1,NULL,'<p>OstroVit Soplówka jeżowata to preparat z serii wegańskich suplementów diety o unikalnych właściwościach. Kapsułki zawierają ekstrakt z popularnego na dalekim wschodzie, m.in. w Chinach oraz Japonii, grzyba o smaku przypominającym owoce morza. Lion’s mane, czyli po prostu lwia grzywa, zawdzięcza swoją nazwę oryginalnemu wyglądowi - kulistej grzybni pokrytej długimi i cienkimi soplami. </p>','ostrovit-soplowka-jezowata-vege-60-kapsulek-',NULL,NULL,NULL,'OstroVit Soplówka Jeżowata VEGE 60 kapsułek ',NULL,NULL,NULL,NULL),(1384,1,1,NULL,'<p>OstroVit Matcha Zielona Herbata w proszku to suplement diety w postaci sproszkowanych liści Camellia sinesis L, czyli zielonej herbaty matcha. Dzięki zawartości kofeiny oraz drogocennych polifenoli napar wykazuje działanie pobudzające, odchudzające oraz oczyszczające. Poszukujesz smacznego napoju, który stanowi alternatywę dla tradycyjnej kawy lub herbaty i jednocześnie jest zdrowy? OstroVit Matcha Zielona Herbata w proszku to odpowiedź na Twoje potrzeby!</p>','ostrovit-matcha-zielona-herbata-w-proszku-100-g-naturalny',NULL,NULL,NULL,'OstroVit Matcha Zielona Herbata w proszku 100 g naturalny',NULL,NULL,NULL,NULL),(1385,1,1,NULL,'<p>OstroVit Ekstrakt z Nawłoci Pospolitej to naturalny ekstrakt roślinny którego składniki wykazują silne właściwości odkażające, ściągające oraz moczopędne.</p>','ostrovit-ekstrakt-z-nawloci-pospolitej-100-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Nawłoci Pospolitej 100 g naturalny',NULL,NULL,NULL,NULL),(1386,1,1,NULL,'<p>OstroVit Ekstrakt z Miłorzębu Japońskiego zawiera w sobie ekstrakt z liści miłorzębu japońskiego (Ginkgo Biloba L.), który wykazuje właściwości poprawiające zdolności kognitywne oraz powstrzymania ich naturalnego pogarszania wraz z wiekiem oraz jako substancja wspierająca pamięć. </p>','ostrovit-ekstrakt-z-milorzebu-japonskiego-50-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Miłorzębu Japońskiego 50 g naturalny',NULL,NULL,NULL,NULL),(1387,1,1,NULL,'<p>OstroVit Ekstrakt z Kozieradki to wszechstronny suplement diety, który sprawdzi się w szczególności u osób zmagających się z problemami trawiennymi i podwyższonym poziomem cholesterolu lub cukru we krwi. Dzięki dużej zawartości witamin, minerałów, saponin, flawonoidów oraz innych ważnych związków ekstrakt z nasion kozieradki może przyczyniać się również do wzmocnienia odporności organizmu. Poszukujesz naturalnego suplementu, dzięki któremu wesprzesz swój układ trawienny i zadbasz o codzienne zdrowie organizmu? Pomoże Ci w tym OstroVit Ekstrakt z Kozieradki.</p>','ostrovit-ekstrakt-z-kozieradki-100-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Kozieradki 100 g naturalny',NULL,NULL,NULL,NULL),(1388,1,1,NULL,'<p>OstroVit Ekstrakt z Ashwagandhy to roślinny suplement diety, którego składniki wykazują działanie wspomagające funkcjonowanie układu nerwowego oraz odpornościowego. Ashwagandha świetnie radzi sobie ze stresem, osłabieniem oraz wyczerpaniem organizmu, a także poprawia Twoją koncentrację i motywację.</p>','ostrovit-ekstrakt-z-ashwagandhy-100-g-naturalny',NULL,NULL,NULL,'OstroVit Ekstrakt z Ashwagandhy 100 g naturalny',NULL,NULL,NULL,NULL),(1389,1,1,NULL,'<p>OstroVit Miłorząb Japoński VEGE to nowoczesny suplement diety w kapsułkach wegańskich zawierający ekstrakt z liści miłorzębu japońskiego (miłorząb dwuklapowy). OstroVit Ginkgo Biloba został opracowany z myślą o osobach kierujących się zasadą weganizmu lub wegetarianizmu, nie zawiera żadnych substancji i związków pochodzenia zwierzęcego, a ekstrakt został zamknięty w specjalne kapsułki HPMC (hydroksypropylometylocelulozowe). Suplementy z linii 100% VEGE CAPSULES to produkty przeznaczone tak naprawdę dla wszystkich, którzy szukają danego ekstraktu i chcą nim uzupełnić swoją dietę, a biorąc pod uwagę osoby, które nie spożywają produktów pochodzenia zwierzęcego każdy tutaj będzie zadowolony. OstroVit to dbałość o szczegóły, jakość i zadowolenie każdego klienta bez wyjątku.</p>','ostrovit-milorzab-japonski-vege-120-kapsulek-',NULL,NULL,NULL,'OstroVit Miłorząb Japoński VEGE 120 kapsułek ',NULL,NULL,NULL,NULL);
